#####################################################################
# Register Usage
#####################################################################

# $t0: Keypress addresses

# $t1: Immediate used in comparison operatores
# $t2: Iterative loop iterator

# $t3: Address calculation

# $t4: Extra temporary values
# $t5: Extra temporary values

# $t6: Start location of drawings

# $t7: States of game (0: main menu, 1: how-to menu, 2: in game, 3: game finish)
# $t8: Player X
# $t9: Player Y

# $s0: Saves previous caller for further nesting
# $s1: Saves previous caller for further nesting

# $s3: Boss previous state
# $s4: Previous health
# $s5: Previous jump state
# $s6: Previous health counter
# $s7: Player movement animation cooldown

#####################################################################
# Constants
#####################################################################

# Simple ~40 FPS
.eqv FRAMERATE  25      # Milliseconds in between frames

# Screen configuration constants
.eqv WIDTH      128     # Screen widths
.eqv WIDTH_ID   127
.eqv WIDTH_BF   512

.eqv HEIGHT     64      # Screen heights
.eqv HEIGHT_ID  63
.eqv HEIGHT_BF  256

.eqv AREA       8192    # Screen areas
.eqv AREA_BF    32768

# Map constants
.eqv PLATFORM_1_X0  32  # Platform 1 constraints
.eqv PLATFORM_1_X1  51
.eqv PLATFORM_1_Y   38

.eqv PLATFORM_2_X0  104  # Platform 2 constraints
.eqv PLATFORM_2_X1  127
.eqv PLATFORM_2_Y   38

.eqv PLATFORM_3_X0  32   # Platform 3 constraints
.eqv PLATFORM_3_X1  47
.eqv PLATFORM_3_Y   20

.eqv PLATFORM_4_X0  108  # Platform 4 constraints
.eqv PLATFORM_4_X1  127
.eqv PLATFORM_4_Y   20

.eqv PLATFORM_5_X0  60   # Platform 5 constraints
.eqv PLATFORM_5_X1  95
.eqv PLATFORM_5_Y   31

.eqv PLATFORM_6_X0  64   # Platform 6 constraints
.eqv PLATFORM_6_X1  91
.eqv PLATFORM_6_Y   15

# Player data
.eqv CHAR_WIDTH   5     # Character constraints
.eqv CHAR_HEIGHT  6
.eqv MIN_X        32
.eqv MIN_Y        1
.eqv MAX_X        123
.eqv MAX_Y        56

.eqv MAX_JUMP_STATE      30     # Animation end states
.eqv MAX_FREEFALL_STATE  19

.eqv MAX_SHOTS     8    # Number of shots
.eqv MAX_SHOTS_BF  32

# Level data
.eqv BOMB_HEALTH_1 1    # Level 1 stats
.eqv BOSS_HEALTH_1 10
.eqv BOSS_DAMAGE_1 1
.eqv ATTACK_TIME_1 750
.eqv ATTACK_CD_1   50
.eqv HEAL_TIMER_1  1000

.eqv BOMB_HEALTH_2 2    # Level 2 stats
.eqv BOSS_HEALTH_2 20
.eqv BOSS_DAMAGE_2 2
.eqv ATTACK_TIME_2 650
.eqv ATTACK_CD_2   40
.eqv HEAL_TIMER_2  700

.eqv BOMB_HEALTH_3 3    # Level 3 stats
.eqv BOSS_HEALTH_3 30
.eqv BOSS_DAMAGE_3 2
.eqv ATTACK_TIME_3 600
.eqv ATTACK_CD_3   60
.eqv HEAL_TIMER_3  400

.eqv REGEN_2  3
.eqv REGEN_3  6

# Key press data
.eqv FRAME_ADR    0x10008000
.eqv KEYPRESS_ADR 0xffff0000

# Game configuration constants
.eqv SHOOT_CD       25          # Shoot cooldown in frames
.eqv INV_FRAMES     30          # Invincibility frames
.eqv ANIMATION_CD   4           # Character walking animation in frames
.eqv BLINK_FRAME    10          # Blink duration in frames
.eqv BOSS_CYCLE     1000        # Boss frame idle/attack cycle

# Memory Data
.data

Menu:           .space AREA_BF                          # The main menu
HowTo:          .space AREA_BF                          # The how to play menu
Background:     .space AREA_BF                          # The game background

MenuSelect:     .word 0                                 # What is selected in the menu (0: Player, 1: How-to, 2: Quit)

Health:         .word 0                                 # Player health
HealMax:        .word 0                                 # Frames per heal
HealTimer:      .word 0                                 # Player heal 1 health timer in frames
Score:          .word 0                                 # Player score
Level:          .word 0                                 # Player level

ShootCD:        .word 0                                 # Shoot cooldown counter
KilledBombs:    .word 0                                 # If player has killed all bombs
KeySpawned:     .word 0                                 # If key has spawned
GottenKey:      .word 0                                 # If player has gotten the key
BossSpawned:    .word 0                                 # If the boss spawned
KilledBoss:     .word 0                                 # If player has killed the boss
PortalSpawned:  .word 0                                 # If portal spawned

BossHealth:     .word 0                                 # Boss health
BossState:      .word 0                                 # Boss state (0: Idle, 1: Attack, 2: Dead) NOTE: cannot be hurt in any state but idle
AttackDamage:   .word 0                                 # Boss attack damage
AttackDir:      .word 0, 0, 0, 0, 0, 0, 0, 0            # Boss attack direction (boss 2 and 3)
AttackX:        .word -1, -1, -1, -1, -1, -1, -1, -1    # Boss attack X positions
AttackY:        .word -1, -1, -1, -1, -1, -1, -1, -1    # Boss attack Y positions
AttackState:    .word 0, 0, 0, 0, 0, 0, 0, 0            # Boss attack drop states (0-X: Drop counter, >X: Will drop, -1: Dropping)
AttackMax:      .word 0                                 # Attack state in frames
AttackFrame:    .word 0                                 # State loop timer
AttackChance:   .word 0                                 # Get the required threshold to throw an attack

BombHealth:     .word 0, 0, 0, 0, 0		        # Changes per level (1/3/5)
BombAnimation:  .word 0, 0, 0, 0, 0		        # Movement (0-12/13-25)
BombDir:	.word 1, 1, 1, 1, 1		        # Movement direction (sprite direction)
BombX:          .word -1, -1, -1, -1, -1	        # X position
BombY:          .word -1, -1, -1, -1, -1	        # Y position

ExpAnimation:   .word 0, 0, 0, 0, 0                     # Explosion animation (None: 0 | Target 1-10/11-20/21-30/31-40 | Explosion: 41-46/47-52/53-58/59-64)
ExpX:           .word -1, -1, -1, -1, -1                # Explosion X coordinate
ExpY:           .word -1, -1, -1, -1, -1                # Explosion Y coordinate

ShotDir:        .word 0, 0, 0, 0, 0, 0, 0, 0            # Bullet travel direction
ShotX:          .word -1, -1, -1, -1, -1, -1, -1, -1    # Bullet X position
ShotY:          .word -1, -1, -1, -1, -1, -1, -1, -1    # Bullet Y position

PreviousX:      .word 0                                 # Previous char X; used in clearing screen
PreviousY:      .word 0                                 # Previous char Y; used in clearing screen
CharAnimation:  .word 0                                 # Character animation type
CharDir:        .word 0                                 # Character facing direction
CharMoveX:      .word 0                                 # Character horizontal displacement

Blink:          .word 0                                 # Blink counter frames
InvFrames:      .word 0                                 # Number of invincibility frames

InJump:         .word 0                                 # Jump state
InDoubleJump:   .word 0                                 # Double jump state
InFreeFall:     .word 0                                 # Freefall state


#####################################################################
# Labels
#####################################################################

########## INITIALIZATION ##########

.text

.globl main


########## MAIN ##########

# Main label
main:                           # Main function
        jal CreateMap                   # Saves the player map in memory
        jal CreateHowto                 # Saves the how-to menu
        jal CreateMenu                  # Saves the main menu

########## INITIATIONS ##########

MenuInit:                       # Initiates the main menu
        jal DrawMenu                    # Draws the main menu

        li $t0, 0                       # Set menu select to 0
        sw $t0, MenuSelect              # Save menu select to 0

        j MenuLoop                      # Go into menu

HowToMenu:                      # Initiates the how-to menu
        jal DrawHowto                   # Draws the how-to menu

        j BackToMenuLoop                # Wait for enter command

LoseScreen:                     # Initiates a win screen
        jal DrawLoseScreen              # Draw the lose screen

        j BackToMenuLoop                # Wait for enter command

WinScreen:                      # Initiates a lose screen
        jal DrawWinScreen               # Draw the win screen

        la $t0, FRAME_ADR               # Get frame address
        addi $t0, $t0, 15632            # Get score start

        j BackToMenuLoop                # Wait for enter command
        
GameInit:                       # Initiates a game
        li $t0, 10                      # Set player health 10
        sw $t0, Health                  # Save player health 10
        li $t0, 1                       # Set level 1
        sw $t0, Level                   # Save level 1
        li $t0, 0                       # Set score 0
        sw $t0, Score                   # Save score 0

InitLevels:                     # Initiates a round from level
        jal DrawMap                     # Draws the playing field

        li $t8, 32                      # Initiates player starting X position
        li $t9, 56                      # Initiates player starting Y position
        sw $t8, PreviousX               # Initiates player previous X position
        sw $t9, PreviousY               # Initiates player previous Y position
        
        li $t0, INV_FRAMES              # Set invincibility frames
        sw $t0, InvFrames               # Save invincibility frames
        li $t0, 1                       # Set character facing right
        sw $t0, CharDir                 # Save character facing right
        li $t0, 0                       # Set shot cooldown
        sw $t0, ShootCD                 # Save shot cooldown
        sw $t0, KilledBombs             # Save killed bombs
        sw $t0, KilledBoss              # Save killed boss
        sw $t0, GottenKey               # Save gotten key
        sw $t0, KeySpawned              # Save key spawned
        sw $t0, BossSpawned             # Save boss spawned
        sw $t0, PortalSpawned           # Save portal spawned
        li $s3, 0                       # Saves previous boss state 0
        lw $s4, Health                  # Saves previous health
        li $s5, 2                       # Saves number of jumps
        
        jal DrawJump                    # Draws the initial jumps
        jal DrawHealth                  # Draws the initial health
        jal DrawCharacter               # Draws the initial character

        li $t7, 0                       # Get offset 0
        li $t0, 79                      # Get X
        sw $t0, BombX($t7)              # Save X
        li $t0, 13                      # Get Y
        sw $t0, BombY($t7)              # Save Y
        li $t7, 4                       # Get offset 4
        li $t0, 38                      # Get X
        sw $t0, BombX($t7)              # Save X
        li $t0, 18                      # Get Y
        sw $t0, BombY($t7)              # Save Y
        li $t7, 8                       # Get offset 8
        li $t0, 117                     # Get X
        sw $t0, BombX($t7)              # Save X
        li $t0, 36                      # Get Y
        sw $t0, BombY($t7)              # Save Y

        li $t0, 0                       # Set bomb counter
        li $t1, 20                      # Set bomb counter limit
        li $a1, 2                       # Set upper bound
        li $v0, 42                      # Set random number command
        
        SetBombDir:                     # Set bomb direction loop
                syscall                         # Get random number
                bnez $a0, BombDirRight          # If facing right
                li $a0, -1                      # Face left
        
        BombDirRight:                   # Set bomb dir right
                sw $a0, BombDir($t0)            # Save direction
        
        NextBombDir:                    # Get next bomb
                addi $t0, $t0, 4                # Next bomb
                blt $t0, $t1, SetBombDir        # If there is next bomb

        lw $t1, Level                   # Get ingoing level
        li $t0, 2                               # Set level 2
        beq $t1, $t0, Level2Init                # Go to level 2
        li $t0, 3                               # Set level 3
        beq $t1, $t0, Level3Init                # Go to level 3

Level1Init:                     # Initiates level 1
        jal DrawLevel1                  # Lights level 1
        jal ClearLevel2                 # Unlights level 2
        jal ClearLevel3                 # Unlights level 3

        li $t0, HEAL_TIMER_1            # Get heal timer 1
        sw $t0, HealMax                 # Save heal max
        sw $t0, HealTimer               # Save heal timer

        li $t0, BOMB_HEALTH_1           # Get bomb health 1
        li $t7, 0                       # Get offset 0
        sw $t0, BombHealth($t7)         # Save bomb 1
        li $t7, 4                       # Get offset 4
        sw $t0, BombHealth($t7)         # Save bomb 2
        li $t7, 8                       # Get offset 8
        sw $t0, BombHealth($t7)         # Save bomb 3

        j GameLoop                      # Start game

Level2Init:                     # Initiates level 2
        jal ClearLevel1                 # Unlights level 1
        jal DrawLevel2                  # Lights level 2
        jal ClearLevel3                 # Unlights level 3

        li $t0, HEAL_TIMER_2            # Get heal timer 2
        sw $t0, HealMax                 # Save heal max
        sw $t0, HealTimer               # Save heal timer

        li $t7, 12                      # Get offset 12
        li $t0, 86                      # Get X
        sw $t0, BombX($t7)              # Save X
        li $t0, 54                      # Get Y
        sw $t0, BombY($t7)              # Save Y

        li $t0, BOMB_HEALTH_2           # Get bomb health 2
        li $t7, 0                       # Get offset 0
        sw $t0, BombHealth($t7)         # Save bomb 1
        li $t7, 4                       # Get offset 4
        sw $t0, BombHealth($t7)         # Save bomb 2
        li $t7, 8                       # Get offset 8
        sw $t0, BombHealth($t7)         # Save bomb 3
        li $t7, 12                      # Get offset 12
        sw $t0, BombHealth($t7)         # Save bomb 4

        j GameLoop                      # Start game

Level3Init:                     # Initiates level 3
        jal ClearLevel1                 # Unlights level 1
        jal ClearLevel2                 # Unlights level 2
        jal DrawLevel3                  # Lights level 3

        li $t0, HEAL_TIMER_3            # Get heal timer 3
        sw $t0, HealMax                 # Save heal max
        sw $t0, HealTimer               # Save heal timer

        li $t7, 12                      # Get offset 12
        li $t0, 86                      # Get X
        sw $t0, BombX($t7)              # Save X
        li $t0, 54                      # Get Y
        sw $t0, BombY($t7)              # Save Y
        li $t7, 16                      # Get offset 16
        li $t0, 65                      # Get X
        sw $t0, BombX($t7)              # Save X
        li $t0, 29                      # Get Y
        sw $t0, BombY($t7)              # Save Y

        li $t0, BOMB_HEALTH_3           # Get bomb health 3
        li $t7, 0                       # Get offset 0
        sw $t0, BombHealth($t7)         # Save bomb 1
        li $t7, 4                       # Get offset 4
        sw $t0, BombHealth($t7)         # Save bomb 2
        li $t7, 8                       # Get offset 8
        sw $t0, BombHealth($t7)         # Save bomb 3
        li $t7, 12                      # Get offset 12
        sw $t0, BombHealth($t7)         # Save bomb 4
        li $t7, 16                      # Get offset 16
        sw $t0, BombHealth($t7)         # Save bomb 5

        j GameLoop                      # Start game

########## LOOPS ##########

MenuLoop:                       # Main menu command loop
        li $t1, 1                       # Get pressed key
        li $t0, KEYPRESS_ADR            # Get key address
        lw $t0, 0($t0)                  # Get if key pressed
        bne $t0, $t1, MenuButtons       # Skip key check if no click
        jal HandleMenuKeypress          # Get menu key press

MenuButtons:                    # Updates the buttons in the menu
        jal ClearMenuButtons            # Clear the buttons
        jal DrawMenuButtons             # Draw the selected button

        li $a0, 50                      # Set sleep timer
        li $v0, 32                      # Set sleep command
        syscall                         # Sleep
        j MenuLoop                      # Iterate again

BackToMenuLoop:                 # Wait for enter command loop
        li $t1, 1                       # Get pressed key
        li $t0, KEYPRESS_ADR            # Get key address
        lw $t0, 0($t0)                  # Get if key pressed
        bne $t0, $t1, BackToMenuSleep   # Skip key check if no click
        jal HandleEnterKeypress         # Get back to menu key press

BackToMenuSleep:                # Sleeps the frame
        li $a0, 50                      # Set sleep timer
        li $v0, 32                      # Set sleep command
        syscall                         # Sleep
        j BackToMenuLoop                # Iterate again

GameLoop:                       # Main frame iterator
        sw $zero, CharMoveX             # Reset horizontal movement

        lw $t1, Health                  # Get health
        add $s6, $zero, $t1             # Save health

UpdateBlink:                    # Check blink
        lw $t1, Blink                   # Get blink counter
        beqz $t1, KeypressLoop       	# If not in blink
        li $t2, BLINK_FRAME             # Get max blink counter
        add $t3, $zero, $t1             # Copy $t1 to $t3
        addi $t1, $t1, -1               # Reduce blink cooldown
        sw $t1, Blink                   # Save blink cooldown
        beq $t3, $t2, StartBlink        # If first frame of blink
        beqz $t1, EndBlink              # If blink ended
        
        j FrameUpdate                   # Get cooldown

StartBlink:                     # Create the blink screen
        jal DrawBlink                   # Draw the blink
        lw $t1, Blink                   # Get blink counter
        addi $t1, $t1, -1               # Reduce blink cooldown
        sw $t1, Blink                   # Save blink cooldown
        j FrameUpdate                   # Get cooldown

EndBlink:                       # Final blink screen
        li $t0, FRAME_ADR               # Set to screen
        jal CreateField                 # Draws the playing field
        jal DrawJump                    # Draws the initial jumps
        jal DrawHealth                  # Draws the initial health

KeypressLoop:                   # Check key pressed
        li $t1, 1                       # Get comparator value
	li $t0, KEYPRESS_ADR		# Get keypress address
        lw $t0, 0($t0)         		# Get keypress
        bne $t0, $t1, NoKeyPressed      # If no key pressed
        jal HandleKeypress              # Check key pressed

NoKeyPressed:                   # If no key pressed, continue loop

CheckPlayerMoved:               # Check if the player moved
        lw $t1, PreviousX               # Get previous X
        bne $t1, $t8, PlayerMoved       # If X and previous X are different
        lw $t1, PreviousY               # Get previous Y
        bne $t1, $t9, PlayerMoved       # If Y and previous Y are different
        j UpdatePosition		# If no movement
        
PlayerMoved:                    # Player did move
        jal ClearChar                   # Clear character

UpdatePosition:                 # Updates previous player positions
        sw $t9, PreviousY               # Save previous Y position
        sw $t8, PreviousX               # Save previous X position

HealUpdate:                     # Heals the player and counts down timer
        lw $t1, HealTimer               # Get heal timer
        beqz $t1, PlayerRegen           # If timer is ready
        addi $t1, $t1, -1               # Decrease timer
        sw $t1, HealTimer               # Save decreased timer
        j InvincibilityUpdate           # Skip heal

PlayerRegen:                    # Heal the player
        lw $t2, Health                  # Get player health
        li $t3, 10                      # Get max health
        beq $t2, $t3, InvincibilityUpdate       # If player max health
        addi $t2, $t2, 1                # Heal player
        sw $t2, Health                  # Save new health
        lw $t1, HealMax                 # Reset timer
        sw $t1, HealTimer               # Save reset timer

InvincibilityUpdate:            # Updates invincibility frames
        lw $t1, InvFrames               # Get invincibility frames
        beqz $t1, ExplosionLoop         # If already 0
        addi $t1, $t1, -1               # Remove a frame
        sw $t1, InvFrames               # Save invincibility frames

ExplosionLoop:                  # Updates explosion positions and animation
        jal EraseExplosions             # Erase Explosions
        jal UpdateExplosions            # Update bomb movements
        jal DrawExplosions              # Draw bombs

BombLoop:                       # Updates bomb positions and animation
        lw $t1, KilledBombs             # Get bombs all killed
        bnez $t1, BossLoop        	# If bombs all killed
        
        jal EraseBombs                  # Erase bombs
        jal UpdateBombs                 # Update bomb movements
        jal DrawBombs                   # Draw bombs

BossLoop:                       # Updates boss state and animation
        lw $t1, BossSpawned             # Get if boss spawned
        beqz $t1, BossAttackLoop        # If boss not spawned
        lw $t1, KilledBoss              # Get if boss is dead
        bnez $t1, BossRedraw            # If boss is dead
	
        lw $t1, BossHealth              # Get boss health
        bnez $t1, BossStateUpdate       # If boss just died
        
SetBossState2:                  # Set boss dead
        li $t1, 2                       # Set state 2
        sw $t1, BossState               # Save state 2
        li $t1, 1                       # Set killed boss
        sw $t1, KilledBoss              # Save killed boss
        li $t0, 0                       # Set frame state
        sw $t1, AttackFrame             # Save frame state
        j BossCheckState                # Skip update state

BossStateUpdate:                # Updates bosses state
        jal UpdateBossState             # Update the boss state

BossCheckState:                 # Checks the state of the boss
        lw $t1, BossState               # Get boss state
        beq $t1, $s3, BossRedraw        # If boss state did not change
        jal EraseBoss                   # Clear the boss

BossRedraw:                     # Redraw the boss
        jal EraseBossAttacks            # Erase old boss attacks
        jal DrawBoss                    # Draw the boss
        lw $t1, BossState               # Get the boss state
        add $s3, $zero, $t1             # Save the previous state

BossAttackLoop:                 # Updates boss attack loops
        lw $t1, BossSpawned             # Get if boss spawned
        beqz $t1, DoubleJumpLoop        # If boss not spawned
        lw $t1, KilledBoss              # Get if boss is dead
        bnez $t1, DoubleJumpLoop        # If boss is dead
        lw $t1, BossState               # Get boss state
        li $t2, 1                       # Get attack state
        bne $t1, $t2, DoubleJumpLoop    # If not in attack phase

        jal UpdateBossAttacks           # Update the attacks
        jal DrawBossAttacks             # Draws the boss attacks

DoubleJumpLoop:                 # Gets character double jump
        lw $t1, InDoubleJump            # Get double jump state
        li $t2, MAX_JUMP_STATE          # Get max jump state
        beq $t1, $t2, FallLoop          # If player is falling
        beqz $t1, JumpLoop              # If player is not double jumping

DoubleJumpUpdate:               # Player starts double jump
        jal DoubleJumpStart             # Player upwards motion
        j MovementLoop                  # Skip jump and falling

JumpLoop:                       # Gets character jump
        lw $t1, InJump                  # Get jump state
        li $t2, MAX_JUMP_STATE          # Get max jump state
        beq $t1, $t2, FallLoop      	# If player is falling
        beqz $t1, FallLoop		# If player is not jumping

JumpUpdate:                     # Player starts jump
        jal JumpStart                   # Player upwards motion
        j MovementLoop			# Skip falling

FallLoop:                       # Gets character freefall
        li $t1, MAX_Y                   # Gets ground level
        blt $t9, $t1, PlatformCheck1    # Start platform checks
        j ResetVerticalMovement		# If landed, reset jump

PlatformCheck1:                 # Checks if player is on platform 1
        li $t1, PLATFORM_1_Y            # Get platform height
        bne $t9, $t1, PlatformCheck3    # If not on the same Y level
        li $t1, PLATFORM_1_X1           # Get rightmost boundary
        bgt $t8, $t1, PlatformCheck2    # If right of platform
        j ResetVerticalMovement         # If landed, reset jump

PlatformCheck2:                 # Checks if player is on platform 2
        li $t1, PLATFORM_2_X0           # Get leftmost boundary
        blt $t8, $t1, PlatformCheck3    # If left of platform
        j ResetVerticalMovement         # If landed, reset jump

PlatformCheck3:                 # Checks if player is on platform 3
        li $t1, PLATFORM_3_Y            # Get platform height
        bne $t9, $t1, PlatformCheck5    # If not on the same Y level
        li $t1, PLATFORM_3_X1           # Get rightmost boundary
        bgt $t8, $t1, PlatformCheck4    # If right of platform
        j ResetVerticalMovement         # If landed, reset jump

PlatformCheck4:                 # Checks if player is on platform 4
        li $t1, PLATFORM_4_X0           # Get leftmost boundary
        blt $t8, $t1, PlatformCheck5    # If left of platform
        j ResetVerticalMovement         # If landed, reset jump

PlatformCheck5:                 # Checks if player is on platform 5
        li $t1, PLATFORM_5_Y            # Get platform height
        bne $t9, $t1, PlatformCheck6    # If not on the same Y level
        li $t1, PLATFORM_5_X0           # Get leftmost boundary
        blt $t8, $t1, PlatformCheck6    # If left of platform
        li $t1, PLATFORM_5_X1           # Get rightmost boundary
        bgt $t8, $t1, PlatformCheck6    # If right of platform
        j ResetVerticalMovement         # If landed, reset jump

PlatformCheck6:                 # Checks if player is on platform 6
        li $t1, PLATFORM_6_Y            # Get platform height
        bne $t9, $t1, FallUpdate        # If not on the same Y level
        li $t1, PLATFORM_6_X0           # Get leftmost boundary
        blt $t8, $t1, FallUpdate        # If left of platform
        li $t1, PLATFORM_6_X1           # Get rightmost boundary
        bgt $t8, $t1, FallUpdate        # If right of platform
        j ResetVerticalMovement         # If landed, reset jump

FallUpdate:                     # Player starts freefall
        jal FreeFallStart               # Player downward motion
        j MovementLoop                  # Player frame update
        
ResetVerticalMovement:          # If the player lands, reset jumps and freefall
        lw $t2, InFreeFall		# If in freefall
        beqz $t2, MovementLoop          # If already reset
        jal DoubleJumpReset             # Reset double jump state
        jal JumpReset                   # Reset jump state
        jal FreeFallReset               # Reset freefall state

MovementLoop:                   # Gets and updates the character location
	lw $a0, CharMoveX		# Load character displacement
        add $t8, $t8, $a0         	# Updates the current position

        bne $a0, $zero, DrawCharLoop    # If horizontal displacement is not zero
        
CheckVerticalMove:              # Checks if play changed vertically
        lw $t1, PreviousY               # Get previous Y position
        sub $t1, $t9, $t1               # Get Y displacement
        beqz $t1, NoMove                # If no Y displacement
        j DrawCharLoop                  # Otherwise, draw character

NoMove:                         # Character did not move, continue loop
        jal SetAnimationZero            # Set displacement to zero

DrawCharLoop:                   # Draws the character
        jal SetNextAnimation            # If displacement is non zero

BulletPositionLoop:             # Updates the bullet positions and draw them
        jal BulletUpdate                # Updates bullet position
        jal DrawBullets                 # Draw the new bullet positions
        jal ShootCooldownUpdate         # Update shooting cooldowns

KeyCollisionLoop:               # Checks key collision with the player
        lw $t1, KeySpawned              # Get key spawned
        beqz $t1, PortalCollisionLoop   # If key did not spawn  
        lw $t1, GottenKey               # Get key obtained
        bnez $t1, PortalCollisionLoop   # If key is already obtained
        jal KeyCollision                # Check key collision

PortalCollisionLoop:            # Checks portal collision with the player
        lw $t1, PortalSpawned           # Get portal spawned
        beqz $t1, BulletCollisionLoop   # If portal did not spawn
        jal PortalCollision             # Check portal collision

BulletCollisionLoop:            # Checks bullet collisions with enemies
        lw $t1, KilledBombs             # Get killed bombs
        bnez $t1, BossCollisionLoop     # If all bombs killed
        jal BulletBombCollision         # Check collision with bombs

BossCollisionLoop:              # Checks bullet collisions with boss
        lw $t1, BossSpawned             # Get boss spawned
        beqz $t1, PlayerCollisionLoop1  # If boss did not spawn
        lw $t1, KilledBoss              # Get killed boss
        bnez $t1, PlayerCollisionLoop1  # If boss already killed
        jal BulletBossCollision         # Check collision with boss

PlayerCollisionLoop1:           # Checks collisions with bombs
        lw $t1, KilledBombs             # Get killed bombs
        bnez $t1, PlayerCollisionLoop2  # If all bombs killed
        jal BombCollision               # Check collision with bombs

PlayerCollisionLoop2:           # Checks collisions with explosions
        la $t1, ExpAnimation            # Get explosion animation
        lw $t2, 0($t1)                  # Get explosion animation 1
        lw $t3, 4($t1)                  # Get explosion animation 2
        add $t2, $t2, $t3               # Add explosion animation 2
        lw $t3, 8($t1)                  # Get explosion animation 3
        add $t2, $t2, $t3               # Add explosion animation 3
        lw $t3, 12($t1)                 # Get explosion animation 4
        add $t2, $t2, $t3               # Add explosion animation 4
        lw $t3, 16($t1)                 # Get explosion animation 5
        add $t2, $t2, $t3               # Add explosion animation 5
        beqz $t2, PlayerCollisionLoop3  # If no bomb animation
        jal ExplosionCollision          # Check collision with explosives

PlayerCollisionLoop3:           # Checks collisions with boss and their attacks
        lw $t1, BossSpawned             # Get boss spawned
        beqz $t1, JumpBarLoop           # If boss did not spawn
        lw $t1, KilledBoss              # Get killed boss
        bnez $t1, JumpBarLoop           # If boss already killed
        jal BossCollision               # Check collision with boss

        lw $t1, BossState               # Get boss state
        li $t2, 1                       # Get attack state
        bne $t1, $t2, JumpBarLoop       # If boss is not in attack phase
        jal BossAttackCollision         # Check collision with boss attacks

JumpBarLoop:                    # Updates the jump bar
        jal GetJumpState                # Check if jump bar needs to be updated
        add $t1, $zero, $s5             # Get temp previous number of jumps
        add $s5, $zero, $s0             # Save new number of jumps
        beq $t1, $s0, HealthBarLoop     # If number of jumps did not change
        jal ClearJump                   # Remove jump bar
        jal DrawJump                    # Redraw jump bar

HealthBarLoop:                  # Updates the health bar
        lw $t1, Health                  # Get current health
        beq $t1, $s6, ScoreLoop         # Skip redrawing the health bar
        jal ClearHealth                 # Remove health bar
        jal DrawHealth                  # Redraw health bar
        lw $s4, Health                  # Save previous health

ScoreLoop:                      # Updates the score
        la $t0, FRAME_ADR               # Get frame address
        addi $t0, $t0, 27184            # Get score start
        jal ClearScore                  # Clear the score
        jal DrawScore                   # Draw the score

GameOverCheck:                  # If game is over
        lw $t1, Health                  # Get player health
        bnez $t1, KilledBombsCheck      # If player still has health
        j LoseScreen                    # Otherwise lost

KilledBombsCheck:               # If all bombs are killed
        lw $t1, KilledBombs             # Get if bombs were killed
        bnez $t1, KeySpawnedCheck       # If all bombs already killed

        la $t1, BombHealth              # Get bomb health address
        lw $t2, 0($t1)                  # Set initial sum to bomb 1 health
        lw $t3, 4($t1)                  # Get bomb 2 health
        add $t2, $t2, $t3               # Add bomb 2 health
        lw $t3, 8($t1)                  # Get bomb 3 health
        add $t2, $t2, $t3               # Add bomb 3 health
        lw $t3, 12($t1)                 # Get bomb 4 health
        add $t2, $t2, $t3               # Add bomb 4 health
        lw $t3, 16($t1)                 # Get bomb 5 health
        add $t2, $t2, $t3               # Add bomb 5 health
        bgtz $t2, FrameUpdate           # If health sum is greater than 0

        li $t1, 1                       # Set all bombs killed
        sw $t1, KilledBombs             # Save all bombs killed

KeySpawnedCheck:                # If key has spawned
        lw $t1, KeySpawned              # Get if key has spawned
        bnez $t1, GottenKeyCheck        # If key already spawned

        jal SpawnKey                    # Spawn the key
        li $t1, 1                       # Set key spawned
        sw $t1, KeySpawned              # Save key spawned

GottenKeyCheck:                 # If key has been obtained
        lw $t1, GottenKey               # Get if key was obtained
        bnez $t1, BossSpawnedCheck      # If the key is already obtained
        j FrameUpdate                   # Wait until key is obtained

BossSpawnedCheck:               # If the boss has spawned
        lw $t1, BossSpawned             # Get if boss has spawned
        bnez $t1, KilledBossCheck       # If the boss has already spawned

        jal SpawnBoss                   # Spawn the boss
        li $t1, 1                       # Set boss spawned
        sw $t1, BossSpawned             # Save boss spawned

KilledBossCheck:                # If the boss was killed
        lw $t1, KilledBoss              # Get if boss was killed
        bnez $t1, PortalSpawnedCheck    # If boss already killed
        j FrameUpdate                   # Wait until boss is killed

PortalSpawnedCheck:             # If portal spawned
        lw $t1, PortalSpawned           # Get if portal spawned
        bnez $t1, FrameUpdate           # If portal already spawned

        jal SpawnPortal                 # Spawn portal
        li $t1, 1                       # Set portal spawned
        sw $t1, PortalSpawned           # Save portal spawned

FrameUpdate:                    # Updates counter and stack for the current frame
        li $v0, 32                      # Set sleep command
        li $t1, FRAMERATE		# Load frame rate
        move $a0, $t1             	# Set sleep timer
        syscall                         # Call command
        
        j GameLoop                      # Next iteration
        

########## HANDLE KEYPRESSES ##########

HandleMenuKeypress:             # Processes menu key presses
        li $t0, KEYPRESS_ADR            # gets keypress address
        lw $t0, 4($t0)                  # loads key pressed

MenuEnter:                      # Processes menu enter
        bne $t0, 0x0a, MenuW            # 'enter' key
        lw $t1, MenuSelect              # Get selected option
        li $t2, 0                       # Set select to 0
        beq $t1, $t2, GameInit          # If selected play game
        li $t2, 1                       # Set select to 1
        beq $t1, $t2, HowToMenu         # If selected how-to menu
        jal ClearScreen                 # Clear the screen
        li $v0, 10                      # Set exit program
        syscall                         # EXIT GAME

MenuW:                          # Processes menu W
        bne $t0, 0x77, MenuS            # 'w' key
        lw $t1, MenuSelect              # Get selected option
        beqz $t1, HandleMenuKeypressEnd # If cannot go up
        addi $t1, $t1, -1               # Go to previous option
        sw $t1, MenuSelect              # Save option
        j HandleMenuKeypressEnd         # End keypress

MenuS:                          # Processes menu S
        bne $t0, 0x73, HandleEnterKeypressEnd   # 's' key
        lw $t1, MenuSelect              # Get selected option
        li $t2, 2                       # Get max option
        beq $t1, $t2,  HandleMenuKeypressEnd    # If cannot go down
        addi $t1, $t1, 1                # Go to next option
        sw $t1, MenuSelect              # Save option

HandleMenuKeypressEnd:          # Ends the keypress checker
        jr $ra                          # Return to caller

HandleEnterKeypress:            # Processes enter key used in 3 screens
        li $t0, KEYPRESS_ADR            # gets keypress address
        lw $t0, 4($t0)                  # loads key pressed

PressedEnter:                   # Enter pressed
        bne $t0, 0x0a, HandleEnterKeypressEnd   # 'enter' key
        j MenuInit                      # Go to menu

HandleEnterKeypressEnd:         # Ends the keypress checker
        jr $ra                          # Return to caller

HandleKeypress:                 # Processes a pressed key
        li $t0, KEYPRESS_ADR            # gets keypress address
        lw $t0, 4($t0)                  # loads key pressed

PressedM:                       # Return to main menu
        bne $t0, 0x6d, PressedP         # 'm' key
        bne $v0, $zero, ReturnToMenu    # if in main menu
        j KeypressExit                  # finish keypress

ReturnToMenu:                   # Return to main menu
        move $ra, $zero                 # reset caller
        j MenuInit                      # jumps to main menu

PressedP:                       # Replay game from start
        bne $t0, 0x70, PressedA         # 'p' key
        move $ra, $zero                 # reset caller
        j GameInit                      # reset game

PressedA:                       # Move Left
        bne $t0, 0x61, PressedD         # 'a' key
        beq $t8, MIN_X, PressedD        # if char can move left
        li $v0, -1                      # set move to left
        lw $v1, CharMoveX               # get current displacement
        beq $v0, $v1, PressedD          # if already clicked in the frame
        sw $v0, CharMoveX               # save move left
        li $v0, 0                       # set direction to left
        sw $v0, CharDir                 # save direction left
        j KeypressExit                  # exit keypress

PressedD:                       # Move Right
        bne $t0, 0x64, PressedW         # 'd' key
        beq $t8, MAX_X, PressedW        # if char can move right
        li $v0, 1                       # set move to right
        lw $v1, CharMoveX               # get current displacement
        beq $v0, $v1, PressedD          # if already clicked in the frame
        sw $v0, CharMoveX               # save move right
        li $v0, 1                       # set direction to right
        sw $v0, CharDir                 # save direction right
        j KeypressExit                  # exit keypress

PressedW:                       # Jump
        bne $t0, 0x77, PressedSpace     # 'w' key
        beq $t8, MIN_Y, PressedSpace    # if char can jump
        lw $t1, InJump                  # load jump state
        bne $t1, $zero, DoubleJump      # if char is already jumping
        li $v0, 1                       # start jump state
        sw $v0, InJump                  # save jump state
        j KeypressExit                  # exit keypress

DoubleJump:                     # Character jumps again
        beq $t8, MIN_Y, PressedSpace    # if char can jump
        lw $t1, InDoubleJump            # load double jump state
        bne $t1, $zero, PressedSpace    # if char is already jumping
        li $v0, 1                       # start double jump state
        sw $v0, InDoubleJump            # save double jump state
        j KeypressExit                  # exit keypress

PressedSpace:                   # Shoots in front of character
        bne $t0, 0x20, KeypressExit     # ' ' key
        lw $t1, ShootCD                 # get shoot cooldown
        bne $t1, $zero, KeypressExit    # if shoot on cooldown
        move $s0, $ra                   # saves next register
        jal HandleShoot                 # fires a shot
        move $ra, $s0                   # loads saved register

KeypressExit:                   # Exits keypress check
        jr $ra                          # jump to next command


########## JUMPING ##########

JumpStart:                      # Make player go up
        lw $t1, InJump                  # Get jump state
        li $a0, MAX_JUMP_STATE          # Get final jump state
        beq $t1, $a0, JumpApexReached   # If jump height reached
        li $a0, 7                       # Load first state boundary
        ble $t1, $a0, JumpState1        # If within first state
        li $a0, 17                      # Load second state boundary
        ble $t1, $a0, JumpState2        # If within second state
        li $a0, 26                      # Load third state boundary
        ble $t1, $a0, JumpState3        # If within third state
        li $a0, 30                      # Load fourth state boundary
        ble $t1, $a0, JumpState4        # If within fourth state

JumpState1:                     # First part of jump
        addi $t9, $t9, -1               # Upward motion
        j JumpSkip                      # End jump

JumpState2:                     # Second part of jump
        li $t2, 2                       # Get frames per pixel
        rem $t2, $t1, $t2               # Get drop frame
        beqz $t2, JumpSkip              # Skip this frame
        addi $t9, $t9, -1               # Upward motion
        j JumpSkip                      # End jump

JumpState3:                     # Third part of jump
        li $t2, 3                       # Get frames per pixel
        rem $t2, $t1, $t2               # Get drop frame
        beqz $t2, JumpSkip              # Skip this frame
        addi $t9, $t9, -1               # Upward motion
        j JumpSkip                      # End jump

JumpState4:                     # Fourth part of jump
        li $t2, 4                       # Get frames per pixel
        rem $t2, $t1, $t2               # Get drop frame
        beqz $t2, JumpSkip              # Skip this frame
        addi $t9, $t9, -1               # Upward motion

JumpSkip:                       # Jump end per frame
        addi $t1, $t1, 1                # Increment jump state
        sw $t1, InJump                  # Save jump state
        li $t3, MIN_Y                   # Get minimum Y
        blt $t9, $t3, JumpStop          # If character is in frame
        jr $ra                          # Return to caller

JumpStop:                       # Check if character is within frame
        li $t1, MAX_JUMP_STATE          # End jump state
        sw $t1, InJump                  # Save jump state
        jr $ra                          # Return to caller

JumpApexReached:                # No more upwards velocity
        li $t1, 1                       # Load freefall start state
        sw $t1, InFreeFall              # Save freefall state
        jr $ra                          # Return to caller

JumpReset:                      # Landed and can jump again
        li $t1, 0                       # Get reset jump state
        sw $t1, InJump                  # Save reset jump state
        jr $ra                          # Return to caller


########## DOUBLE JUMPING ##########

DoubleJumpStart:                # Make player go up (again)
        lw $t1, InDoubleJump            # Get double jump state
        li $a0, MAX_JUMP_STATE          # Get final double jump state
        beq $t1, $a0, DoubleJumpApexReached     # If double jump height reached
        li $a0, 1                       # Special first state of double jump
        beq $t1, $a0, DoubleJumpInit    # If within special state
        li $a0, 7                       # Load first state boundary
        ble $t1, $a0, DoubleJumpState1  # If within first state
        li $a0, 17                      # Load second state boundary
        ble $t1, $a0, DoubleJumpState2  # If within second state
        li $a0, 26                      # Load third state boundary
        ble $t1, $a0, DoubleJumpState3  # If within third state
        li $a0, 30                      # Load fourth state boundary
        ble $t1, $a0, DoubleJumpState4  # If within fourth state

DoubleJumpInit:                 # Initiates first frame of double jump
        li $a0, MAX_JUMP_STATE          # Load max jump state
        sw $a0, InJump                  # Save max jump state
        li $a0, 0                       # Load non freefall state
        sw $a0, InFreeFall              # Save non freefall state

DoubleJumpState1:               # First part of jump
        addi $t9, $t9, -1               # Upward motion
        j DoubleJumpSkip                # End jump

DoubleJumpState2:               # Second part of jump
        li $t2, 2                       # Get frames per pixel
        rem $t2, $t1, $t2               # Get drop frame
        beqz $t2, DoubleJumpSkip        # Skip this frame
        addi $t9, $t9, -1               # Upward motion
        j DoubleJumpSkip                # End jump

DoubleJumpState3:               # Third part of jump
        li $t2, 3                       # Get frames per pixel
        rem $t2, $t1, $t2               # Get drop frame
        beqz $t2, DoubleJumpSkip        # Skip this frame
        addi $t9, $t9, -1               # Upward motion
        j DoubleJumpSkip                # End jump

DoubleJumpState4:               # Fourth part of jump
        li $t2, 4                       # Get frames per pixel
        rem $t2, $t1, $t2               # Get drop frame
        beqz $t2, DoubleJumpSkip        # Skip this frame
        addi $t9, $t9, -1               # Upward motion

DoubleJumpSkip:                 # Jump end per frame
        addi $t1, $t1, 1                # Increment jump state
        sw $t1, InDoubleJump            # Save jump state
        li $t3, MIN_Y                   # Get minimum Y
        blt $t9, $t3, DoubleJumpStop    # If character is in frame
        jr $ra                          # Return to caller

DoubleJumpStop:                 # Check if character is within frame
        li $t1, MAX_JUMP_STATE          # End jump state
        sw $t1, InDoubleJump            # Save jump state
        jr $ra                          # Return to caller

DoubleJumpApexReached:          # No more upwards velocity
        li $t1, 1                       # Load freefall start state
        sw $t1, InFreeFall              # Save freefall state
        jr $ra                          # Return to caller

DoubleJumpReset:                # Landed and can jump again
        li $t1, 0                       # Get reset jump state
        sw $t1, InDoubleJump            # Save reset jump state
        jr $ra                          # Return to caller

GetJumpState:                   # Gets number of jumps
        li $s0, 2                       # Set return value as 2
        lw $t1, InDoubleJump            # Get double jump state
        bgtz $t1, StateDoubleJump       # If used both jumps
        lw $t1, InJump                  # Get jump state
        bgtz $t1, StateJump             # If used only one jump
        jr $ra                          # Return to caller

StateJump:                      # Sets jump state
        li $s0, 1                       # Set return value as 1
        jr $ra                          # Return to caller

StateDoubleJump:                # Sets double jump state
        li $s0, 0                       # Set return value as 0
        jr $ra                          # Return to caller


########## FREEFALLING ##########

FreeFallStart:                  # Make player go down
        lw $t1, InFreeFall              # Get freefall state
        beqz $t1, SetFreeFall           # If freefall state is 0
        li $a0, MAX_FREEFALL_STATE      # Get final freefall state
        beq $t1, $a0, FreeFallTerminal  # If terminal velocity reached
        li $a0, 9                       # Load first state boundary
        ble $t1, $a0, FreeFallState1    # If within first state
        li $a0, 19                      # Load second state boundary
        ble $t1, $a0, FreeFallState2    # If within second state

FreeFallState1:                 # First part of freefall
        li $t2, 3                       # Get frames per pixel
        rem $t2, $t1, $t2               # Get drop frame
        beqz $t2, FreeFallSkip          # Skip this frame
        addi $t9, $t9, 1                # Move down
        j FreeFallSkip                  # End freefall

FreeFallState2:                 # Second part of freefall
        li $t2, 2                       # Get frames per pixel
        rem $t2, $t1, $t2               # Get drop frame
        beqz $t2, FreeFallSkip          # Skip this frame
        addi $t9, $t9, 1                # Move down

FreeFallSkip:                   # Freefall end per frame
        addi $t1, $t1, 1                # Next freefall state
        sw $t1, InFreeFall              # Save freefall state
        jr $ra                          # Return to caller

FreeFallTerminal:               # Terminal velocity freefall
        addi $t9, $t9, 1                # Move down
        jr $ra                          # Return to caller

FreeFallReset:                  # Landed and no longer in free fall
        li $t1, 0                       # Get reset freefall state
        sw $t1, InFreeFall              # Save reset freefall state
        jr $ra                          # Return to caller

SetFreeFall:                    # If falling from platform
        li $t1, 1                       # Set freefall state
        sw $t1, InFreeFall              # Save freefall state
        j FreeFallStart                 # Start falling


########## COLLISIONS ##########

BombCollision:                  # Checks collision with bombs
        li $a0, 0                       # Set bomb index
        li $a1, 20                      # Set counter

BombCollisionLoop:              # Check each bomb
        lw $t1, BombHealth($a0)         # Get bomb health
        beqz $t1, BombCollisionNext     # If bomb is dead

        li $t1, 3                       # Get offset X
        add $t1, $t1, $t8               # Add player X position
        lw $t2, BombX($a0)              # Get bomb X position
        sub $t1, $t1, $t2               # Subtract bomb X position
        bltz $t1, BombCollisionNext     # If less than X range
        li $t2, 8                       # Get X range
        bgt $t1, $t2, BombCollisionNext # If greater than X range

        li $t1, 2                       # Get offset Y
        add $t1, $t1, $t9               # Add player Y position
        lw $t2, BombY($a0)              # Get bomb Y position
        sub $t1, $t1, $t2               # Subtract bomb Y position
        bltz $t1, BombCollisionNext     # If less than Y range
        li $t2, 9                       # Get Y range
        bgt $t1, $t2, BombCollisionNext # If greater than Y range

        j HandlePlayerCollision         # Otherwise collide

BombCollisionNext:              # Move to next bomb
        addi $a0, $a0, 4                # Increment bomb
        blt $a0, $a1, BombCollisionLoop # If next bomb exists
        jr $ra                          # Return to caller

ExplosionCollision:             # Checks collision with explosions
        li $a0, 0                       # Set explosion index
        li $a1, 20                      # Set counter

ExplosionCollisionLoop:         # Check each explosion
        lw $t1, ExpAnimation($a0)       # Get explosion X animation
        li $t2, 40                      # Get explosion damage animation
        ble $t1, $t2, ExplosionCollisionNext    # If explosion does not exist

        li $t1, 3                       # Get offset X
        add $t1, $t1, $t8               # Add player X position
        lw $t2, ExpX($a0)               # Get explsion X position
        sub $t1, $t1, $t2               # Substract explosion X position
        bltz $t1, ExplosionCollisionNext        # If less than X range
        li $t2, 14                      # Get X range
        bgt $t1, $t2, ExplosionCollisionNext    # If greater than X range

        li $t1, 4                       # Get offset Y
        add $t1, $t1, $t9               # Add player Y position
        lw $t2, ExpY($a0)               # Get explsion Y position
        sub $t1, $t1, $t2               # Substract explosion Y position
        bltz $t1, ExplosionCollisionNext        # If less than Y range
        li $t2, 15                      # Get Y range
        bgt $t1, $t2, ExplosionCollisionNext    # If greater than Y range

        j HandlePlayerCollision         # Otherwise collide

ExplosionCollisionNext:         # Move to next explosion
        addi $a0, $a0, 4                # Increment explosion
        blt $a0, $a1, ExplosionCollisionLoop    # If next explosion exists
        jr $ra                          # Return to caller

BossCollision:                  # Checks collision with boss
        li $t1, 3                       # Get offset X
        add $t1, $t1, $t8               # Add player X position
        li $t2, 64                      # Get boss X position
        sub $t1, $t1, $t2               # Subtract boss X position
        bltz $t1, PlayerCollisionEnd    # If less than X range
        li $t2, 30                      # Get X range
        bgt $t1, $t2, PlayerCollisionEnd        # If greater than X range

        li $t1, 4                       # Get offset Y
        add $t1, $t1, $t9               # Add player Y position
        li $t2, 5                       # Get boss Y position
        sub $t1, $t1, $t2               # Subtract boss Y position
        bltz $t1, PlayerCollisionEnd    # If less than Y range
        li $t2, 33                      # Get Y range
        bgt $t1, $t2, PlayerCollisionEnd        # If greater than Y range

        j HandlePlayerCollision         # Otherwise collide

BossAttackCollision:            # Selects the correct boss to test collisions
        lw $t1, Level                   # Get the level
        li $t2, 3                       # Set level 3
        beq $t1, $t2, Boss3AttackCollision      # Check boss 3 collisions

Boss12AttackCollision:          # Checks collision with boss 1 and 2 attacks
        li $a0, 0                       # Set attack index
        li $a1, 32                      # Set attack counter

Boss12AttackCollisionLoop:      # Check each attack
        lw $t1, AttackState($a0)        # Get attack state
        bgez $t1, Boss12AttackCollisionNext     # If attack is not active

        li $t1, 3                       # Get offset X
        add $t1, $t1, $t8               # Add player X position
        lw $t2, AttackX($a0)            # Get bomb X position
        sub $t1, $t1, $t2               # Subtract bomb X position
        bltz $t1, Boss12AttackCollisionNext     # If less than X range
        li $t2, 12                      # Get X range
        bgt $t1, $t2, Boss12AttackCollisionNext # If greater than X range

        li $t1, 4                       # Get offset Y
        add $t1, $t1, $t9               # Add player Y position
        lw $t2, AttackY($a0)            # Get bomb Y position
        sub $t1, $t1, $t2               # Subtract bomb Y position
        bltz $t1, Boss12AttackCollisionNext     # If less than Y range
        li $t2, 21                      # Get Y range
        bgt $t1, $t2, Boss12AttackCollisionNext # If greater than Y range

        j HandleBossAttackCollision     # Otherwise collide

Boss12AttackCollisionNext:      # Move to next attack
        addi $a0, $a0, 4                # Increment bomb
        blt $a0, $a1, Boss12AttackCollisionLoop # If next bomb exists
        jr $ra                          # Return to caller

Boss3AttackCollision:           # Checks collision with boss 3 attacks
        li $a0, 0                       # Set attack index
        li $a1, 32                      # Set attack counter

Boss3AttackCollisionLoop:       # Check each attack
        lw $t1, AttackState($a0)        # Get attack state
        bgez $t1, Boss3AttackCollisionNext      # If attack is not active

        li $t1, 3                       # Get offset X
        add $t1, $t1, $t8               # Add player X position
        lw $t2, AttackX($a0)            # Get bomb X position
        sub $t1, $t1, $t2               # Subtract bomb X position
        bltz $t1, Boss3AttackCollisionNext      # If less than X range
        li $t2, 22                      # Get X range
        bgt $t1, $t2, Boss3AttackCollisionNext  # If greater than X range

        li $t1, 4                       # Get offset Y
        add $t1, $t1, $t9               # Add player Y position
        lw $t2, AttackY($a0)            # Get bomb Y position
        sub $t1, $t1, $t2               # Subtract bomb Y position
        bltz $t1, Boss3AttackCollisionNext      # If less than Y range
        li $t2, 12                      # Get Y range
        bgt $t1, $t2, Boss3AttackCollisionNext  # If greater than Y range

        j HandleBossAttackCollision     # Otherwise collide

Boss3AttackCollisionNext:       # Move to next attack
        addi $a0, $a0, 4                # Increment bomb
        blt $a0, $a1, Boss3AttackCollisionLoop  # If next bomb exists
        jr $ra                          # Return to caller

HandleBossAttackCollision:      # Handles player collisions
        lw $t1, InvFrames               # Get invincibility frames
        bnez $t1, PlayerCollisionEnd    # If player is already invincible

        lw $t1, Health                  # Get player health
        lw $t2, AttackDamage            # Get boss damage
        sub $t1, $t1, $t2               # Decrease health by boss damage
        bltz $t1, NegativeHealth        # If health is negative
        sw $t1, Health                  # Save health
        j AttackCollisionEnd            # Skip setting health negative

NegativeHealth:                 # Check if health is negative
        sw $zero, Health                # Save health to 0

AttackCollisionEnd:             # Finish boss attack collision
        li $t1, INV_FRAMES              # Get max invincibility frames
        sw $t1, InvFrames               # Save invincibility frames
        j PlayerCollisionEnd            # End collision

HandlePlayerCollision:          # Handles player collisions
        lw $t1, InvFrames               # Get invincibility frames
        bnez $t1, PlayerCollisionEnd    # If player is already invincible

        lw $t1, Health                  # Get player health
        addi $t1, $t1, -1               # Decrease health by 1
        sw $t1, Health                  # Save health

        li $t1, INV_FRAMES              # Get max invincibility frames
        sw $t1, InvFrames               # Save invincibility frames

PlayerCollisionEnd:             # Ends player collision
        jr $ra                          # Return to caller

KeyCollision:                   # Checks key collision
        li $t1, 4                       # Get offset X
        add $t1, $t1, $t8               # Add player X position
        li $t2, 76                      # Get key X position
        sub $t1, $t1, $t2               # Subtract key X position
        bltz $t1, UnlockCollisionEnd    # If less than X range
        li $t2, 10                      # Get X range
        bgt $t1, $t2, UnlockCollisionEnd        # If greater than X range

        li $t1, 5                       # Get offset Y
        add $t1, $t1, $t9               # Add player Y position
        li $t2, 54                      # Get key Y position
        sub $t1, $t1, $t2               # Subtract key Y position
        bltz $t1, UnlockCollisionEnd    # If less than Y range
        li $t2, 7                       # Get Y range
        bgt $t1, $t2, UnlockCollisionEnd        # If greater than Y range

        li $t2, 1                       # Set gotten key
        sw $t2, GottenKey               # Save gotten key
        li $t1, BLINK_FRAME             # Get blink timer
        sw $t1, Blink                   # Save blink timer
        j ClearKey                      # Remove key from the map

PortalCollision:                # Checks portal collision
        li $t1, 4                       # Get offset X
        add $t1, $t1, $t8               # Add player X position
        li $t2, 73                      # Get key X position
        sub $t1, $t1, $t2               # Subtract key X position
        bltz $t1, UnlockCollisionEnd    # If less than X range
        li $t2, 17                      # Get X range
        bgt $t1, $t2, UnlockCollisionEnd        # If greater than X range

        li $t1, 5                       # Get offset Y
        add $t1, $t1, $t9               # Add player Y position
        li $t2, 43                      # Get key Y position
        sub $t1, $t1, $t2               # Subtract key Y position
        bltz $t1, UnlockCollisionEnd    # If less than Y range
        li $t2, 22                      # Get Y range
        bgt $t1, $t2, UnlockCollisionEnd        # If greater than Y range

NextLevel:                      # Enter next level
        lw $t1, Health                  # Get health
        lw $t2, Level                   # Get level
        mul $t1, $t1, $t2               # Get round score
        lw $t3, Score                   # Get current score
        add $t1, $t1, $t3               # Add to score
        addi $t1, $t2, 1                # Next level
        sw $t1, Level                   # Save next level
        li $t2, 3                       # Get highest level
        bgt $t1, $t2, WinScreen         # If game won
        jal HealPlayer                  # Heals the player
        
        j InitLevels                    # Initiate next stage

HealPlayer:                     # Heals the player
        li $a0, 10                      # Set max health
        lw $t1, Health                  # Get player health
        beq $t1, $a0, HealPlayerEnd     # Player max health
        lw $t2, Level                   # Get level
        li $t3, 3                       # Set comparator to 3
        beq $t2, $t3, Heal3             # If level is now 3
        add $t1, $t1, REGEN_2           # Heal level 1-2 health
        sw $t1, Health                  # Save new health
        j HealthCap

Heal3:                          # Heal level 2-3 health
        add $t1, $t1, REGEN_3           # Heal level 1-2 health
        sw $t1, Health                  # Save new health

HealthCap:                      # Check if health is larger than max
        lw $t1, Health                  # Get player health
        ble $t1, $a0, HealPlayerEnd     # Player max health
        sw $a0, Health                  # Save max health

HealPlayerEnd:                  # Finishes healing player
        jr $ra                          # Return to caller

UnlockCollisionEnd:             # Ends portal and key collision
        jr $ra                          # Return to caller

BulletBossCollision:            # Checks collision of bullets with bosses
        li $t0, 0                       # Set bullet index
        li $a0, 32                      # Set bullet counter max
        lw $t1, BossState               # Get boss state
        beqz $t1, BulletBossLoop        # If boss can be damaged
        jr $ra                          # Return to caller

BulletBossLoop:                 # Checks each bullet
        lw $t2, ShotX($t0)              # Get bullet X position
        bltz $t2, BulletBossNext        # If bullet exists

        lw $t2, ShotX($t0)              # Get bullet X position
        li $t3, 3                       # Get offset X
        add $t2, $t2, $t3               # Add bullet X position
        li $t3, 64                      # Get boss X position
        sub $t2, $t2, $t3               # Subtract boss X position
        bltz $t2, BulletBossNext        # If less than X range
        li $t3, 34                      # Get X range
        bgt $t2, $t3, BulletBossNext    # If greater than X range

        lw $t2, ShotY($t0)              # Get bullet Y position
        li $t3, 2                       # Get offset Y
        add $t2, $t2, $t3               # Add bullet Y position
        li $t3, 5                       # Get boss Y position
        sub $t2, $t2, $t3               # Subtract boss Y position
        bltz $t2, BulletBossNext        # If less than Y range
        li $t3, 33                      # Get Y range
        bgt $t2, $t3, BulletBossNext    # If greater than Y range

        j HandleBossCollision         	# Otherwise collide

BulletBossNext:                 # Get next bullet
        addi $t0, $t0, 4                # Increment bullet
        blt $t0, $a0, BulletBossLoop    # If next bullet exists
        jr $ra                          # Return to caller

HandleBossCollision:            # Handles bullet collisions
        move $s0, $ra                   # Save original caller
        lw $t2, BossHealth              # Get hit boss health
        addi $t2, $t2, -1               # Decrease boss health
        sw $t2, BossHealth              # Save boss health
        j KillBossBullet                # Skip kill bomb

KillBossBullet:                 # Kill the bullet used on the boss
        add $t6, $zero, $t0             # Copy $t0 to $t6
        jal EraseBullet                 # Erase the bullet
        li $t2, -1                      # Set empty X and Y position
        sw $t2, ShotX($t6)              # Save empty X position
        sw $t2, ShotY($t6)              # Save empty Y position
        li $t2, 0                       # Set direction to 0
        sw $t2, ShotDir($t6)            # Save non-direction
        move $ra, $s0                   # Load original caller

BulletBossEnd:                  # End shooting boss
        jr $ra                          # Return to caller

BulletBombCollision:            # Checks collision of bullets with
        li $t0, 0                       # Set bomb index
        li $a0, 20                      # Set bomb counter max

BulletBombCollisionLoop:        # Checks each bomb
        lw $t2, BombHealth($t0)         # Get bomb health
        beqz $t2, BulletBombCollisionNext       # If bomb is dead
        
        li $t1, 0                       # Set bullet index
        li $a1, 32                      # Set bullet counter max

BulletBombLoop:                 # Checks each bullet
        lw $t2, ShotX($t1)              # Get bullet X position
        bltz $t2, BulletBombNext        # If bullet exists

        lw $t2, ShotX($t1)              # Get bullet X position
        li $t3, 3                       # Get offset X
        add $t2, $t2, $t3               # Add bullet X position
        lw $t3, BombX($t0)              # Get bomb X position
        sub $t2, $t2, $t3               # Subtract bomb X position
        bltz $t2, BulletBombNext        # If less than X range
        li $t3, 9                       # Get X range
        bgt $t2, $t3, BulletBombNext    # If greater than X range

        lw $t2, ShotY($t1)              # Get bullet Y position
        lw $t3, BombY($t0)              # Get bomb Y position
        sub $t2, $t2, $t3               # Subtract bomb Y position
        bltz $t2, BulletBombNext        # If less than Y range
        li $t3, 7                       # Get Y range
        bgt $t2, $t3, BulletBombNext    # If greater than Y range

        j HandleBulletCollision         # Otherwise collide

BulletBombNext:                 # Get next bullet
        addi $t1, $t1, 4                # Increment bullet
        blt $t1, $a1, BulletBombLoop    # If next bullet exists

BulletBombCollisionNext:        # Get next bomb
        addi $t0, $t0, 4                # Increment bomb
        blt $t0, $a0, BulletBombCollisionLoop   # If next bomb exists
        jr $ra                          # Return to caller

HandleBulletCollision:          # Handles bullet collisions
        move $s0, $ra                   # Save original caller
        lw $t2, BombHealth($t0)         # Get hit bomb health
        addi $t2, $t2, -1               # Decrease bomb health
        sw $t2, BombHealth($t0)         # Save bomb health
        beqz $t2, KillBomb              # If bomb is killed
        j KillBullet                    # Skip kill bomb

KillBomb:                       # Kill the bomb
        add $a0, $zero, $t0             # Copy $t0 to $a0
        add $v0, $zero, $t0		# Copy $t0 to $v0
        li $a1, 1			# Set number of bombs
        li $a2, 6			# Get columns
        add $s1, $zero, $t1             # Copy $t1 to $s2
        sw $a1, BombHealth($t0)         # Let health be 1 to erase character
        jal EraseBomb                   # Erase the bomb
        li $t2, -1                      # Set initial X and Y
        sw $t2, BombX($v0)              # Save X position
        sw $t2, BombY($v0)              # Save Y position
        li $t2, 0                       # Set initial animation
        sw $t2, BombAnimation($v0)      # Save X position
        li $t2, 1                       # Set initial direction
        sw $t2, BombDir($v0)            # Save X position
        sw $zero, BombHealth($v0)       # Reduce health back to 0
        jal SpawnExplosion              # Create an explosion
        add $t1, $zero, $s1             # Reassign original $t1

KillBullet:                     # Kill the bullet
        add $t6, $zero, $t1             # Copy $t1 to $t6
        jal EraseBullet                 # Erase the bullet
        li $t2, -1                      # Set empty X and Y position
        sw $t2, ShotX($t6)              # Save empty X position
        sw $t2, ShotY($t6)              # Save empty Y position
        li $t2, 0                       # Set direction to 0
        sw $t2, ShotDir($t6)            # Save non-direction
        move $ra, $s0                   # Load original caller

BulletCollisionEnd:             # Ends bullet collisions
        jr $ra                          # Return to caller

########## SPAWN EXPLOSION ##########

SpawnExplosion:                 # Spawns an explosion on the player location
        addi $t1, $t8, -4               # Get left X
        li $t2, 32                      # Get left bound
        blt $t1, $t2, SetExplosionMinX  # Set min X
        addi $t1, $t8, 8                # Get right X
        li $t2, 115                     # Get left bound
        bgt $t1, $t2, SetExplosionMaxX  # Set max X
       
        li $t3, -4                      # Set offset X
        add $t3, $t3, $t8               # Set X position
        j SpawnExplosionGetY            # Get Y

SetExplosionMinX:               # Set explosion min X
        li $t3, 32                      # Set min X
        j SpawnExplosionGetY            # Get Y

SetExplosionMaxX:               # Set explosion max X
        li $t3, 115                      # Set max X

SpawnExplosionGetY:             # Set the Y value of explosion
        addi $t1, $t9, -3               # Get top Y
        li $t2, 0                       # Get top bound
        blt $t1, $t2, SetExplosionMinY  # Set min Y
        addi $t1, $t9, -9               # Get bottom Y
        li $t2, 51                      # Get bottom bound
        bgt $t1, $t2, SetExplosionMaxY  # Set max Y

        li $t4, -3                      # Set offset Y
        add $t4, $t4, $t9               # Set Y position
        j CreateExplosion               # Make the explosion

SetExplosionMinY:               # Set explosion min Y
        li $t4, 0                       # Set min X
        j CreateExplosion               # Create the explosion

SetExplosionMaxY:               # Set explosion max Y
        li $t4, 0                       # Set max X

CreateExplosion:                # Create the explosion
        li $t1, 1                       # Set animation 1
        sw $t1, ExpAnimation($v0)       # Save animation 1
        sw $t3, ExpX($v0)               # Save explosion X position
        sw $t4, ExpY($v0)               # Save explosion Y position
        jr $ra                          # Save explosion data


########## SPAWN KEYS AND PORTALS ##########

SpawnKey:                       # Spawns the key
        li $t6, FRAME_ADR               # Set spawn pixel
        j DrawKey                       # Draw the key

SpawnPortal:                    # Spawns the portal
        li $t6, FRAME_ADR               # Set spawn pixel
        j DrawPortal                    # Draw the portal

########## SPAWN BOSS ATTACKS ##########

SpawnBossAttack:                # Spawns the boss attacks
        add $t0, $zero, $t1             # Set iterator to $t0
        lw $t3, Level                   # Get the level
        li $t2, 2                       # Set level 2
        beq $t3, $t2, SpawnBoss2Attack  # If level 2
        li $t2, 3                       # Set level 3
        beq $t3, $t2, SpawnBoss3Attack  # If level 3

SpawnBoss1Attack:               # Spawns boss 1 attack
        li $t3, 0                       # Set start Y
        sw $t3, AttackY($t0)            # Save start Y
        li $t3, -1                      # Set falling
        sw $t3, AttackState($t0)        # Save falling
        j ResetState                    # Reset the other none falling objects

SpawnBoss2Attack:               # Spawns boss 2 attack
        li $a1, 2                       # Set random upper bound
        li $v0, 42                      # Set random command
        syscall                         # Call random command
        sw $a0, AttackDir($t0)          # Save attack sprite
        li $t3, 0                       # Set start Y
        sw $t3, AttackY($t0)            # Save start Y
        li $t3, -1                      # Set falling
        sw $t3, AttackState($t0)        # Save falling
        j ResetState                    # Reset the other none falling objects

SpawnBoss3Attack:               # Spawns boss 3 attack
        li $a1, 2                       # Set random upper bound
        li $v0, 42                      # Set random command
        syscall                         # Call random command
        add $a0, $a0 , $a0              # Double random number
        addi $a0, $a0, -1               # Subtract 1 from random number (0 -> -1, 1 -> 1)
        sw $a0, AttackDir($t0)          # Save attack direction
        li $t3, 38                      # Set multiplier
        mul $t3, $a0, $t3               # Multiply direction by 38
        sub $t3, $zero, $t3             # Flip signs
        addi $t3, $t3, 70               # Add 70 from direction (-1 -> 108, 1 -> 32)
        sw $t3, AttackX($t0)            # Save start X
        li $t3, -1                      # Set falling
        sw $t3, AttackState($t0)        # Save falling
        j ResetState                    # Reset the other none falling objects

ResetState:                     # Reset the boss attack states
        li $t0, 0                       # Set iterator
        li $a0, 32                      # Set max iteration

ResetStateLoop:                 # Reset the state all but active attacks
        lw $t2, AttackState($t0)        # Get attack state
        bltz $t2, ResetStateNext        # If already in animation

        li $t2, 0                       # Set reset state value
        sw $t2, AttackState($t0)        # Save reset state value

ResetStateNext:                 # Get next attack to reset
        addi $t0, $t0, 4                # Get next attack
        blt $t0, $a0, ResetStateLoop    # Next attack
        j UpdateBossAttackNext          # Update next attack

ForceResetState:                # Resets all boss attacks
        li $t0, 0                       # Set iterator
        li $a0, 32                      # Set max iteration

ForceResetStateLoop:            # Reset the state of the attack
        li $t1, 0                       # Set reset state value
        sw $t1, AttackState($t0)        # Save reset state value
        addi $t0, $t0, 4                # Get next attack
        blt $t0, $a0, ForceResetStateLoop       # Next attack
        jr $ra                          # Return to caller

UpdateBossAttacks:              # Update boss attack state
        move $s0, $ra                   # Save original caller
        li $t1, 0                       # Get counter
        li $t7, 32                      # Set bullet count

UpdateBossAttackLoop:           # Update each attack (position)
        lw $t0, AttackState($t1)        # Get attack frame
        bgez $t0, UpdateBossAttackSpawn         # If attack is not spawned

        lw $t2, Level                   # Get level
        li $t3, 3                       # Get level 3
        beq $t2, $t3, UpdateBossAttack3 # If boss is level 3
        
        lw $t2, AttackY($t1)            # Get attack Y
        addi $t2, $t2, 1                # Drop position by 1 pixel
        li $t3, 44                      # Get max Y
        bgt $t2, $t3, BossAttackDelete12        # Delete this attack
        sw $t2, AttackY($t1)            # Save new position
        j UpdateBossAttackNext          # Go to next attack

BossAttackDelete12:             # Reset a boss 1 or 2 attack
        lw $t0, AttackY($t1)            # Get attack Y
        mul $t0, $t0, WIDTH             # Get row
        lw $t7, AttackX($t1)            # Get attack X
        add $t0, $t0, $t7               # Get column
        mul $t0 , $t0, 4                # Get pixel size
        add $t6, $zero, $t1             # Set $t6 to iterator
        add $a0, $zero, $t1             # Set $a0 to iterator
        add $a2, $zero, $7              # Set $a2 to limit
        jal EraseBossAttack             # Erase the attack
        add $t1, $zero, $a0             # Get iterator back
        add $t7, $zero, $a2             # Get limit back
        li $t2, -1                      # Set empty Y position
        sw $t2, AttackY($t1)            # Save empty Y position
        li $t2, 0                       # Set animation 0
        sw $t2, AttackState($t1)        # Save animation 0
        j UpdateBossAttackNext          # Go to next attack

UpdateBossAttack3:              # Update position of boss attacks for boss 3
        lw $t2, AttackX($t1)            # Get attack X
        lw $t3, AttackDir($t1)          # Get attack direction
        add $t2, $t2, $t3               # Drop position by 1 pixel
        li $t3, 32                      # Get min X
        blt $t2, $t3, BossAttackDelete3 # If below min
        li $t3, 108                     # Get max X
        bgt $t2, $t3, BossAttackDelete3 # If above max
        sw $t2, AttackX($t1)            # Save new position
        j UpdateBossAttackNext          # Go to next attack

BossAttackDelete3:               # Reset a boss 3 attack
        lw $t0, AttackY($t1)            # Get attack Y
        mul $t0, $t0, WIDTH             # Get row
        lw $t7, AttackX($t1)            # Get attack X
        add $t0, $t0, $t7               # Get column
        mul $t0 , $t0, 4                # Get pixel size
        add $t6, $zero, $t1             # Set $t6 to iterator
        add $a0, $zero, $t1             # Set $a0 to iterator
        add $a2, $zero, $7              # Set $a2 to limit
        jal EraseBossAttack             # Erase the attack
        add $t1, $zero, $a0             # Set $a0 to iterator
        add $t7, $zero, $a2             # Get limit back
        li $t2, -1                      # Set empty X position
        sw $t2, AttackX($t1)            # Save empty X position
        li $t2, 0                       # Set animation 0
        sw $t2, AttackState($t1)        # Save animation 0
        j UpdateBossAttackNext          # Go to next attack

UpdateBossAttackSpawn:          # Update each attack (spawn)
        lw $t2, AttackState($t1)        # Get attack state
        lw $t3, AttackChance            # Get attack threshold
        bgt $t2, $t3, SpawnBossAttack   # If reached threshold, spawn attack

        li $a1, 4                       # Set random upper limit
        li $v0, 42                      # Set command random number
        syscall                         # Call command
        addi $a0, $a0, 1                # Set lowest add to 1
        add $t2, $t2, $a0               # Add random value
        sw $t2, AttackState($t1)        # Save new attack state

UpdateBossAttackNext:           # Update next attack
        addi $t1, $t1, 4                # Increment counter
        blt $t1, $t7, UpdateBossAttackLoop      # Next attack

UpdateBossAttackEnd:            # End boss attack loop
        move $ra, $s0                   # Load original caller
        jr $ra                          # Return to caller

########## SPAWN BOSS ##########

SpawnBoss:                      # Spawns the boss
        lw $t1, Level                   # Get the level
        li $t2, 2                       # Get level 2
        beq $t1, $t2, SpawnBoss2        # If level is 2
        li $t2, 3                       # Get level 3
        beq $t1, $t2, SpawnBoss3        # If level is 3

SpawnBoss1:                     # Spawns boss 1
        li $t1, BOSS_HEALTH_1           # Set boss 1 health
        sw $t1, BossHealth              # Save boss 1 health
        li $t1, BOSS_DAMAGE_1           # Set boss 1 damage
        sw $t1, AttackDamage            # Save boss 1 damage
        li $t1, ATTACK_TIME_1           # Set invincibility frame time
        sw $t1, AttackMax               # Save invincibility frame time
        li $t1, ATTACK_CD_1             # Set boss 1 attack threshold
        sw $t1, AttackChance            # Save boss 1 attack threshold

        la $t2, AttackX                 # Get attack X position address 
        li $t1, 33                      # Set attack 1 X
        sw $t1, 0($t2)                  # Save attack 1 X
        li $t1, 45                      # Set attack 2 X
        sw $t1, 4($t2)                  # Save attack 2 X
        li $t1, 57                      # Set attack 3 X
        sw $t1, 8($t2)                  # Save attack 3 X
        li $t1, 69                      # Set attack 4 X
