########## BOSS UPDATE ##########

UpdateBossState:                # Update the boss state
        lw $t1, AttackFrame             # Get the frame state
        beqz $t1, ResetBossCycle        # Reset the cycle
        lw $t2, AttackMax               # Get the attack frame start
        beq $t1, $t2, BossStateAttack   # Set boss state to attack
        j UpdateBossStateEnd            # Stay in current state

ResetBossCycle:                 # Reset the boss cycle
        li $t1, BOSS_CYCLE              # Get max boss cycle frames
        sw $t1, AttackFrame             # Save boss cycle frames
        sw $zero, BossState             # Boss state returns to idle
        move $s0, $ra                   # Save original caller
        jal EraseBossAttacks            # Erase currently on screen attacks
        jal ForceResetState             # Forcefully reset all attacks
        move $ra, $s0                   # Load original caller
        j UpdateBossStateEnd            # Enter next frame state

BossStateAttack:                # Set boss state to attack
        li $t1, 1                       # Set boss state to attack
        sw $t1, BossState               # Save boss state to attack

UpdateBossStateEnd:             # End boss state update
        lw $t1, AttackFrame             # Get the frame state
        addi $t1, $t1, -1               # Next boss frame state
        sw $t1, AttackFrame             # Save the boss frame state
        jr $ra                          # Return to caller


########## SHOOTING ##########

HandleShoot:                    # Creates a shot
        lw $t1, ShootCD                 # Get shot cooldown
        bgtz $t1, ShootFinish           # If shot on cooldown
        li $t6, 0                       # Set index for finding available shot
        li $t3, MAX_SHOTS_BF            # Get end offset
        lw $t4, CharDir                 # Get character facing direction

ShootLoop:                      # Spawn a shot on the next available array slot
        lw $t1, ShotX($t6)              # Get array X position
        bgtz $t1, NextShotSlot          # Check if spot has space
        bnez $t4, ShootRight            # If not facing left

ShootLeft:                      # Spawn a shot facing left
        addi $t1, $t8, -4               # Set X position
        li $t5, MIN_X                   # Get minimum X
        blt $t1, $t5, ShootFinish       # If shot not within frame
        sw $t1, ShotX($t6)              # Save X position
        addi $t1, $t9, 1                # Set Y position
        sw $t1, ShotY($t6)              # Save Y position
        li $t1, -1                      # Set bullet direction to left
        sw $t1, ShotDir($t6)            # Set bullet direction
        j ShootCooldown                 # Set cooldown

ShootRight:                     # Spawn a shot facing right
        addi $t1, $t8, CHAR_WIDTH       # Set X position
        li $t5, MAX_X                   # Get maximum X
        bgt $t1, $t5, ShootFinish       # If shot not within frame
        sw $t1, ShotX($t6)              # Save X position
        addi $t1, $t9, 1                # Set Y position
        sw $t1, ShotY($t6)              # Save Y position
        li $t1, 1                       # Set bullet direction to right
        sw $t1, ShotDir($t6)            # Set bullet direction

ShootCooldown:                  # Reset shot cooldown
        li $t1, SHOOT_CD                # Get shot cooldown
        sw $t1, ShootCD                 # Save shot cooldown
        j ShootFinish                   # End bullet create

NextShotSlot:                   # Go to the next array spot
        addi $t6, $t6, 4                # Next shot
        blt $t6, $t3, ShootLoop         # If within array

ShootFinish:                    # Finish shooting
        jr $ra                          # Return to caller

BulletUpdate:                   # Updates the position of bullets
        move $s0, $ra                   # Save original caller
        li $t3, MIN_X                   # Get minimum X
        li $t4, MAX_X                   # Get maximum X
        li $t6, 0                       # Set start offset
        li $t5, MAX_SHOTS_BF            # Get end offset

BulletUpdateLoop:               # Update each bullet
        lw $t1, ShotX($t6)              # Get array X position
        blt $t1, $zero, BulletNext      # If bullet does not exist
        lw $t2, ShotDir($t6)            # Get bullet direction
        add $t2, $t1, $t2               # Set new X position
        blt $t2, $t3, DeleteBullet      # If less than min X
        bgt $t2, $t4, DeleteBullet      # If more than max X
        jal EraseBullet                 # Erase the bullet from the map
        sw $t2, ShotX($t6)              # Save new X position
        j BulletNext                    # Get next bullet

DeleteBullet:                   # Remove a bullet
        jal EraseBullet                 # Erase the bullet from the map

        li $t1, -1                      # Set empty X and Y position
        sw $t1, ShotX($t6)              # Save empty X position
        sw $t1, ShotY($t6)              # Save empty Y position
        li $t1, 0                       # Set direction to 0
        sw $t1, ShotDir($t6)            # Save non-direction

BulletNext:                     # Go to next slot
        addi $t6, $t6, 4                # Next shot
        blt $t6, $t5, BulletUpdateLoop  # If within array

BulletUpdateExit:               # Finish updating position
        move $ra, $s0                   # Load original caller
        jr $ra                          # Return to caller

ShootCooldownUpdate:            # Decrease shoot cooldown
        lw $t1, ShootCD                 # Get cooldown
        beqz $t1, ShootCooldownEnd      # If player already can shoot
        addi $t1, $t1, -1               # Decrease cooldown
        sw $t1, ShootCD                 # Save cooldown

ShootCooldownEnd:               # Finish reducing cooldown
        jr $ra                          # Return to caller

DrawBullets:                    # Draws all bullets
        move $s0, $ra                   # Save original caller
        li $t0, 0                       # Set start offset
        li $t5, MAX_SHOTS_BF            # Set end offset

DrawBulletLoop:                 # Draws each bullet
        lw $t1, ShotX($t0)              # Get array X position
        bltz $t1, DrawBulletNext        # If bullet does not exist
        
        lw $t1, ShotY($t0)              # Get Y position
        mul $t6, $t1, WIDTH             # Get row
        lw $t1, ShotX($t0)              # Get X position
        add $t6, $t6, $t1               # Get column
        mul $t6, $t6, 4                 # Multiply pixel size
        add $t6, $t6, FRAME_ADR         # Add frame

        lw $t1, ShotDir($t0)            # Get bullet direction
        bgtz $t1, RightBullet           # If direction is right

LeftBullet:                     # If bullet moved left
        jal DrawBulletLeft              # Draw bullet facing left
        j DrawBulletNext                # Draw next bullet

RightBullet:                    # If bullet moved right
        jal DrawBulletRight             # Draw bullet facing right

DrawBulletNext:                 # Draw the next bullet
        addi $t0, $t0, 4                # Next shot
        blt $t0, $t5, DrawBulletLoop    # If within array
        move $ra, $s0                   # Load original caller
        jr $ra                          # Return to caller

EraseBullet:                    # Erase previous bullet frame
        la $t7, Background              # Get background
        lw $t1, ShotY($t6)              # Get Y position
        mul $t0, $t1, WIDTH             # Get row
        lw $t1, ShotX($t6)              # Get X position
        add $t0, $t0, $t1               # Get column
        mul $t0, $t0, 4                 # Multiply pixel size
        add $t7, $t0, $t7               # Add to background
        add $t0, $t0, FRAME_ADR         # Add frame
        
        lw $t1, 0($t7)
        sw $t1, 0($t0)
        lw $t1, 4($t7)
        sw $t1, 4($t0)
        lw $t1, 8($t7)
        sw $t1, 8($t0)
        lw $t1, 12($t7)
        sw $t1, 12($t0)
        lw $t1, 512($t7)
        sw $t1, 512($t0)
        lw $t1, 516($t7)
        sw $t1, 516($t0)
        lw $t1, 520($t7)
        sw $t1, 520($t0)
        lw $t1, 524($t7)
        sw $t1, 524($t0)
        lw $t1, 1024($t7)
        sw $t1, 1024($t0)
        lw $t1, 1028($t7)
        sw $t1, 1028($t0)
        lw $t1, 1032($t7)
        sw $t1, 1032($t0)
        lw $t1, 1036($t7)
        sw $t1, 1036($t0)

        jr $ra


########## SET ANIMATIONS ##########

SetAnimationZero:               # Sets the animation to zero
        li $a0, 0                       # Set animation to zero
        sw $a0, CharAnimation           # Saves animation
        bne $s7, $zero, ReduceStandingCD        # If animation is on cooldown
        jr $ra                          # Return to caller

ReduceStandingCD:               # Reduce animation cooldown
        li $s7, 0                       # Reduce animation cooldown to 0
        jr $ra                          # Return to caller

SetNextAnimation:               # Sets the animation to next animation
        bne $s7, $zero, ReduceAnimationCD       # If animation is on cooldown
        lw $a0, CharAnimation           # Get character animation
        li $t1, 1                       # Get comparator value
        beq $a0, $t1, RemoveAnimation   # If animation is 1
        li $a0, 1                       # Next animation
        sw $a0, CharAnimation           # Saves animation
        li $s7, ANIMATION_CD            # Put animation on cooldown
        j AnimationEnd                  # End set animation

RemoveAnimation:                # Reduces animation if already 1
        li $a0, 0                       # Set animation to 0
        sw $a0, CharAnimation           # Saves animation
        li $s7, ANIMATION_CD            # Put animation on cooldown
        
ReduceAnimationCD:              # Reduce the animation cooldown
        addi $s7, $s7, -1               # Reduce cooldown
        j AnimationEnd                  # Draws animation

AnimationEnd:                   # Finishes determining animation
        move $s0, $ra                   # Save previous location
        jal DrawCharacter               # Draws new character
        move $ra, $s0                   # Load precious location
        jr $ra                          # Returns to caller


########## DRAW CHARACTER ##########

DrawCharacter:                  # Set character location
        mul $t3, $t9, WIDTH             # Get row
        add $t3, $t3, $t8               # Get column
        mul $t3, $t3, 4                 # Multiply pixel size
        add $t6, $t3, FRAME_ADR         # Adds the offset
        
        lw $t1, CharAnimation           # Get the animation to be drawn
        bne $t1, $zero, GetMove         # If not animation 0

GetNotMove:                     # If character is in animation 0
        lw $t1, CharDir                 # Get facing direction
        beq $t1, $zero, DrawCharacterLeft       # If facing left
        j DrawCharacterRight            # If facing right

GetMove:                        # If character moved
        lw $t1, CharDir                 # Get character displacement
        beq $t1, $zero, DrawCharacterLeftMove   # If displacement is left
        j DrawCharacterRightMove        # If displacement is right


########## ERASE PREVIOUS CHAR ##########

ClearChar:                      # Get the side initiation
	lw $t2, PreviousY		# Get previoux Y
	mul $t1, $t2, WIDTH             # Get row
