        add $t1, $t1, $t2               # Get column
        mul $t1, $t1, 4                 # Multiply pixel size
        add $t6, $t1, FRAME_ADR         # Adds the offset

        la $t5, Background              # Get the background colours
        add $t5, $t5, $t1               # Get starting pixel

        lw $t2, CharAnimation           # Get the animation
        lw $t3, CharDir                 # Get the direction

