########## DRAW BOMBS ##########

DrawBombs:                      # Draw all available bombs
        move $s0, $ra                   # Set original caller
        li $a0, 0                       # Set bomb index
        li $a1, 5                       # set counter

DrawBombLoop:                   # Draw each bomb
        lw $t1, BombHealth($a0)         # Get bomb health
        beqz $t1, DrawBombNext          # If bomb is dead

        lw $t1, BombY($a0)              # Get bomb Y
        mul $t0, $t1, WIDTH             # Get row
        lw $t1, BombX($a0)              # Get bomb X
        add $t0, $t0, $t1               # Get column
        mul $t0, $t0, 4                 # Set pixel size
        add $t0, $t0, FRAME_ADR         # Move to frame

        jal DrawBomb                    # Draw the bomb

DrawBombNext:                   # Move to next bomb
        addi $a0, $a0, 4                # Increment bomb
        addi $a1, $a1, -1               # Increment counter
        bgtz $a1, DrawBombLoop          # If next bomb exists
        
        move $ra, $s0                   # Get original caller
        jr $ra                          # Return to caller

DrawBomb:                       # Draw a bomb unit
        li $t6, 12                      # Set max animation
        lw $t1, BombAnimation($a0)      # Get animation state
        lw $t2, BombDir($a0)            # Get facing direction
        bgt $t1, $t6, DrawBombWalk      # If in second animation
        bgtz $t2, DrawBombRight         # If bomb facing right
        j DrawBombLeft                  # If bomb facing left

DrawBombWalk:                   # Draw a bomb if animation is active
        bgtz $t2, DrawBombRightMove     # If bomb facing right
        j DrawBombLeftMove              # If bomb facing left

EraseBombs:                     # Erase all bombs on screen
        li $a0, 0                       # Set bomb index
        li $a1, 5                       # set counter
        li $a2, 6                       # Set column count

EraseBomb:                      # Erase a single bomb
        lw $t1, BombHealth($a0)         # Get bomb health
        beqz $t1, EraseBombNext         # If bomb is dead

        la $t7, Background              # Get background
        lw $t1, BombY($a0)              # Get bomb Y
        mul $t0, $t1, WIDTH             # Get row
        lw $t1, BombX($a0)              # Get bomb X
        add $t0, $t0, $t1               # Get column
        mul $t0, $t0, 4                 # Set pixel size
        add $t7, $t7, $t0               # Get background pixel
        add $t0, $t0, FRAME_ADR         # Move to frame
        
        li $t2, 0                       # Set column counter

EraseBombLoop:                  # Erase by column
        lw $t1, 0($t7)
        sw $t1, 0($t0)
        lw $t1, 512($t7)
        sw $t1, 512($t0)
        lw $t1, 1024($t7)
        sw $t1, 1024($t0)
        lw $t1, 1536($t7)
        sw $t1, 1536($t0)
        lw $t1, 2048($t7)
        sw $t1, 2048($t0)
        lw $t1, 2560($t7)
        sw $t1, 2560($t0)
        lw $t1, 3072($t7)
        sw $t1, 3072($t0)
        lw $t1, 3584($t7)
        sw $t1, 3584($t0)
        
        add $t0, $t0, 4                 # Add offset
        add $t7, $t7, 4                 # Add offset

        addi $t2, $t2, 1                # Increment column
        blt $t2, $a2, EraseBombLoop     # Next column

EraseBombNext:                  # Get next bomb to erase
        addi $a0, $a0, 4                # Increment counter
        addi $a1, $a1, -1               # Increment counter
        bgtz $a1, EraseBomb         	# Erase next bomb
        jr $ra                          # Return to caller

UpdateBombs:                    # Update bomb movement
        li $a0, 0                       # Set bomb index
        li $a1, 5                       # set counter

UpdateBombLoop:                 # Update each bomb
        lw $t1, BombHealth($a0)         # Get bomb health
        beqz $t1, UpdateBombNext        # If bomb is dead

        lw $t1, BombAnimation($a0)      # Get bomb animation
        addi $t1, $t1, 1                # Get next animation
        rem $t1, $t1, 26                # Get animation state
        sw $t1, BombAnimation($a0)      # Save bomb animation

        lw $t1, BombX($a0)              # Get bomb X
        lw $t2, BombDir($a0)            # Get bomb direction
        add $t1, $t1, $t2               # Move in direction
        sw $t1, BombX($a0)              # Save move

BoundaryCheck:                  # Check if character is within bounds
        li $t2, MIN_X                   # Get min X
        blt $t1, $t2, SetBombBound      # Set boundary to min
        li $t2, MAX_X                   # Get max X
        bgt $t1, $t2, SetBombBound      # Set boundary to max
        j PlatformBombCheck1            # Check platform

SetBombBound:                   # Set location to bounds X and reverse direction
        sw $t2, BombX($a0)              # Save bounds
        lw $t3, BombDir($a0)            # Get bomb direction
        sub $t3, $zero, $t3             # Reverse direction
        sw $t3, BombDir($a0)            # Save direction
        j UpdateBombNext                # Get to next bomb

PlatformBombCheck1:             # Check platform 1
        li $t2, 0            		# Get bomb number
        bne $a0, $t2, PlatformBombCheck2    	# Check next platform
        li $t2, PLATFORM_6_X0           # Get leftmost platform boundary
        blt $t1, $t2, PlatformTurnAround        # Turn bomb around
        li $t2, PLATFORM_6_X1           # Get rightmost platform boundary
        bgt $t1, $t2, PlatformTurnAround        # Turn bomb around
        j UpdateBombNext		# Get next bomb

PlatformBombCheck2:             # Check platform 2
        li $t2, 4                       # Get bomb number
        bne $a0, $t2, PlatformBombCheck3    	# Check next platform
        li $t2, PLATFORM_3_X1           # Get rightmost platform boundary
        bgt $t1, $t2, PlatformTurnAround        # Turn bomb around
        j UpdateBombNext		# Get next bomb

PlatformBombCheck3:             # Check platform 3
        li $t2, 8                       # Get bomb number
        bne $a0, $t2, PlatformBombCheck4    	# Check next platform
        li $t2, PLATFORM_2_X0           # Get leftmost platform boundary
        blt $t1, $t2, PlatformTurnAround        # Turn bomb around
        j UpdateBombNext		# Get next bomb

PlatformBombCheck4:             # Check platform 4
        li $t2, 12                      # Get bomb number
        bne $a0, $t2, PlatformBombCheck5    	# Check next platform
        j UpdateBombNext		# Get next bomb

PlatformBombCheck5:             # Check platform 5
        li $t2, PLATFORM_5_X0           # Get leftmost platform boundary
        blt $t1, $t2, PlatformTurnAround        # Turn bomb around
        li $t2, PLATFORM_5_X1           # Get rightmost platform boundary
        bgt $t1, $t2, PlatformTurnAround        # Turn bomb around
        j UpdateBombNext		# Get next bomb
        
PlatformTurnAround:             # Turn bomb around
        lw $t2, BombDir($a0)            # Get bomb direction
        sub $t2, $zero, $t2             # Reverse direction
        add $t1, $t1, $t2               # Return to previous location
        sw $t2, BombDir($a0)            # Save direction
        sw $t1, BombX($a0)              # Save X position

UpdateBombNext:                 # Update the next bomb
        addi $a0, $a0, 4                # Increment bomb
        addi $a1, $a1, -1               # Increment counter
        bgtz $a1, UpdateBombLoop        # If next bomb exists
        jr $ra                          # Return to caller
        

