########## DRAW EXPLOSIONS ##########

EraseExplosions:                # Erase all explosions on screen
        li $a0, 0                       # Set explosion index
        li $a1, 5                       # set counter
        li $a2, 13                      # Set column count

EraseExplosion:                 # Erase a single explosion
        lw $t1, ExpAnimation($a0)       # Get explosion state
        beqz $t1, EraseExplosionNext    # If explosion is dead

        la $t7, Background              # Get background
        lw $t1, ExpY($a0)               # Get explosion Y
        mul $t0, $t1, WIDTH             # Get row
        lw $t1, ExpX($a0)               # Get explosion X
        add $t0, $t0, $t1               # Get column
        mul $t0, $t0, 4                 # Set pixel size
        add $t7, $t7, $t0               # Get background pixel
        add $t0, $t0, FRAME_ADR         # Move to frame
        
        li $t2, 0                       # Set column counter

EraseExplosionLoop:             # Erase by column
        lw $t1, 0($t7)
        sw $t1, 0($t0)
        lw $t1, 512($t7)
        sw $t1, 512($t0)
        lw $t1, 1024($t7)
        sw $t1, 1024($t0)
        lw $t1, 1536($t7)
        sw $t1, 1536($t0)
        lw $t1, 2048($t7)
        sw $t1, 2048($t0)
        lw $t1, 2560($t7)
        sw $t1, 2560($t0)
        lw $t1, 3072($t7)
        sw $t1, 3072($t0)
        lw $t1, 3584($t7)
        sw $t1, 3584($t0)
        lw $t1, 4096($t7)
        sw $t1, 4096($t0)
        lw $t1, 4608($t7)
        sw $t1, 4608($t0)
        lw $t1, 5120($t7)
        sw $t1, 5120($t0)
        lw $t1, 5632($t7)
        sw $t1, 5632($t0)
        lw $t1, 6144($t7)
        sw $t1, 6144($t0)
        
        add $t0, $t0, 4                 # Add offset
        add $t7, $t7, 4                 # Add offset

        addi $t2, $t2, 1                # Increment column
        blt $t2, $a2, EraseExplosionLoop        # Next column

EraseExplosionNext:             # Get next explosion to erase
        addi $a0, $a0, 4                # Increment counter
        addi $a1, $a1, -1               # Increment counter
        bgtz $a1, EraseExplosion        # Erase next bomb
        jr $ra                          # Return to caller

UpdateExplosions:               # Update the explosion animation
        li $a0, 0                       # Set bomb index
        li $a1, 5                       # set counter

UpdateExplosionLoop:            # Update each explosion
        lw $t1, ExpAnimation($a0)       # Get explosion animation
        beqz $t1, UpdateExplosionNext   # If explosion is dead

        addi $t1, $t1, 1                # Get next animation
        rem $t1, $t1, 64                # Get animation state
        sw $t1, ExpAnimation($a0)       # Save explosion animation

UpdateExplosionNext:            # Update the next explosion
        addi $a0, $a0, 4                # Increment bomb
        addi $a1, $a1, -1               # Increment counter
        bgtz $a1, UpdateExplosionLoop   # If next bomb exists
        jr $ra   

DrawExplosions:                 # Draw all explosions
        move $s0, $ra                   # Set original caller
        li $a0, 0                       # Set bomb index
        li $a1, 5                       # set counter

DrawExplosionLoop:              # Draw all explosions
        lw $t1, ExpAnimation($a0)       # Get explosion animation
        beqz $t1, DrawExplosionNext     # If explosion is dead
        lw $t1, ExpY($a0)               # Get explosion Y
        mul $t0, $t1, WIDTH             # Get row
        lw $t1, ExpX($a0)               # Get explosion X
        add $t0, $t0, $t1               # Get column
        mul $t0, $t0, 4                 # Set pixel size
        add $t0, $t0, FRAME_ADR         # Move to frame

        jal DrawExplosion               # Draw the bomb

DrawExplosionNext:              # Get next explosion
        addi $a0, $a0, 4                # Increment explosion
        addi $a1, $a1, -1               # Increment counter
        bgtz $a1, DrawExplosionLoop     # If next explostion exists
        
        move $ra, $s0                   # Get original caller
        jr $ra                          # Return to caller

DrawExplosion:                  # Draw a single explosion
        lw $t1, ExpAnimation($a0)       # Get animation state
        beqz $t1, DrawExplosionEnd      # If no animation
        li $t2, 10                      # Get animation 1
        ble $t1, $t2, DrawTarget1       # Draw animation 1
        li $t2, 20                      # Get animation 2
        ble $t1, $t2, DrawTarget2       # Draw animation 2
        li $t2, 30                      # Get animation 3
        ble $t1, $t2, DrawTarget3       # Draw animation 3
        li $t2, 40                      # Get animation 4
        ble $t1, $t2, DrawTarget4       # Draw animation 4
        li $t2, 46                      # Get animation 5
        ble $t1, $t2, DrawExplosion1    # Draw animation 5
        li $t2, 52                      # Get animation 6
        ble $t1, $t2, DrawExplosion2    # Draw animation 6
        li $t2, 58                      # Get animation 7
        ble $t1, $t2, DrawExplosion3    # Draw animation 7
        j DrawExplosion4                # Draw animation 8

DrawExplosionEnd:               # End draw explosion
        jr $ra                          # Return to caller

