DrawBoss1:                      # Draws boss 1
        li $a0, 64                      # Get the X position
        li $a1, 5                       # Get the Y position
        mul $t0, $a1, WIDTH             # Get row
        add $t0, $t0, $a0               # Get column
        mul $t0, $t0, 4                 # Get pixel size
        add $t0, $t0, FRAME_ADR         # Move to screen

