########## DRAW BOSS ATTACKS ##########

EraseBossAttacks:               # Erase all boss attacks
        li $t6, 0                       # Set iterator
        li $a0, 32                      # Set iterator condition

EraseBossAttack:                # Erase a single boss attack
        lw $t2, AttackState($t6)        # Get attack state
        bgez $t2, EraseBossAttackNext   # If attack not active

        li $t7, 0                       # Set iterator
        li $a1, 80                      # Set column count

EraseBossAttackSelector:        # Get the boss
        lw $t0, AttackY($t6)            # Get attack Y
        mul $t0, $t0, WIDTH             # Get row
        lw $t5, AttackX($t6)            # Get attack X
        add $t0, $t0, $t5               # Get column
        mul $t0, $t0, 4                 # Get pixel size
        lw $t2, Level                   # Get level
        li $t3, 3                       # Set level 3
        beq $t2, $t3, EraseBoss3Attacks # If level 3

EraseBoss12Attacks:             # Erase boss 1 and 2 attacks
        li $a1, 40                      # Set column count to 10
        la $t2, Background              # Get background
        add $t3, $t0, $t7               # Get column offset
        add $t2, $t2, $t3               # Get pixel on background
        add $t3, $t3, FRAME_ADR         # Get pixel on screen

        lw $t5, 0($t2)
        sw $t5, 0($t3)
        lw $t5, 512($t2)
        sw $t5, 512($t3)
        lw $t5, 1024($t2)
        sw $t5, 1024($t3)
        lw $t5, 1536($t2)
        sw $t5, 1536($t3)
        lw $t5, 2048($t2)
        sw $t5, 2048($t3)
        lw $t5, 2560($t2)
        sw $t5, 2560($t3)
        lw $t5, 3072($t2)
        sw $t5, 3072($t3)
        lw $t5, 3584($t2)
        sw $t5, 3584($t3)
        lw $t5, 4096($t2)
        sw $t5, 4096($t3)
        lw $t5, 4608($t2)
        sw $t5, 4608($t3)
        lw $t5, 5120($t2)
        sw $t5, 5120($t3)
        lw $t5, 5632($t2)
        sw $t5, 5632($t3)
        lw $t5, 6144($t2)
        sw $t5, 6144($t3)
        lw $t5, 6656($t2)
        sw $t5, 6656($t3)
        lw $t5, 7168($t2)
        sw $t5, 7168($t3)
        lw $t5, 7680($t2)
        sw $t5, 7680($t3)
        lw $t5, 8192($t2)
        sw $t5, 8192($t3)
        lw $t5, 8704($t2)
        sw $t5, 8704($t3)
        lw $t5, 9216($t2)
        sw $t5, 9216($t3)
        lw $t5, 9728($t2)
        sw $t5, 9728($t3)

        j EraseBossAttackRCNext         # Go to next boss attack

EraseBoss3Attacks:              # Erase boss 3 attacks
        la $t2, Background              # Get background
        add $t3, $t0, $t7               # Get column offset
        add $t2, $t2, $t3               # Get pixel on background
        add $t3, $t3, FRAME_ADR         # Get pixel on screen

        lw $t5, 0($t2)
        sw $t5, 0($t3)
        lw $t5, 512($t2)
        sw $t5, 512($t3)
        lw $t5, 1024($t2)
        sw $t5, 1024($t3)
        lw $t5, 1536($t2)
        sw $t5, 1536($t3)
        lw $t5, 2048($t2)
        sw $t5, 2048($t3)
        lw $t5, 2560($t2)
        sw $t5, 2560($t3)
        lw $t5, 3072($t2)
        sw $t5, 3072($t3)
        lw $t5, 3584($t2)
        sw $t5, 3584($t3)
        lw $t5, 4096($t2)
        sw $t5, 4096($t3)
        lw $t5, 4608($t2)
        sw $t5, 4608($t3)

        j EraseBossAttackRCNext         # Go to next boss attack

EraseBossAttackRCNext:          # Go to next boss attack column/row
        addi $t7, $t7, 4                # Add to iterator
        blt $t7, $a1, EraseBossAttackSelector   # Next column/row

EraseBossAttackNext:            # Go to next boss attack
        addi $t6, $t6, 4                # Add to iterator
        blt $t6, $a0, EraseBossAttack   # Next attack
        jr $ra                          # Return to caller

DrawBossAttacks:                # Draws all boss attacks active
        move $s0, $ra                   # Save original caller
        li $t4, 0                       # Set iterator
        li $a1, 32                      # Set iterator condition

DrawBossAttackSelector:         # Selects the boss
        lw $t2, AttackState($t4)        # Get attack state
        bgez $t2, DrawBossAttackNext    # If attack is not active
        
        lw $t0, AttackY($t4)            # Get attack Y
        mul $t0, $t0, WIDTH             # Get row
        lw $t5, AttackX($t4)            # Get attack X
        add $t0, $t0, $t5               # Get column
        mul $t0, $t0, 4                 # Get pixel size
        add $t0, $t0, FRAME_ADR         # Get frame

        lw $t2, Level                   # Get level
        li $t3, 2                       # Set level 2
        beq $t2, $t3, DrawBossAttack2   # If level 2
        li $t3, 3                       # Set level 3
        beq $t2, $t3, DrawBossAttack3   # If level 3

DrawBossAttack1:                # Draws each attack of boss 1
        jal DrawBoss1Attack1            # Draw attack
        j DrawBossAttackNext            # Next attack

DrawBossAttack2:                # Draws each attack of boss 2
        lw $t5, AttackDir($t4)          # Get sprite type
        bgtz $t5, DrawBossAttack2Type2  # If second sprite
        jal DrawBoss2Attack1            # Draw attack
        j DrawBossAttackNext            # Next attack

DrawBossAttack2Type2:           # Draws the second type of boss 2 attack
        jal DrawBoss2Attack2            # Draw attack
        j DrawBossAttackNext            # Next attack

DrawBossAttack3:                # Draws each attack of boss 3
        lw $t5, AttackDir($t4)          # Get sprite type
        bgtz $t5, DrawBossAttack3Type2  # If second sprite
        jal DrawBoss3Attack1            # Draw attack
        j DrawBossAttackNext            # Next attack

DrawBossAttack3Type2:           # Draws the second type of boss 3 attack
        jal DrawBoss3Attack2            # Draw attack
        j DrawBossAttackNext            # Next attack

DrawBossAttackNext:             # Get next attack
        addi $t4, $t4, 4                # Increment interator
        blt $t4, $a1, DrawBossAttackSelector    # Next attack
        move $ra, $s0                   # Load original caller
        jr $ra                          # Return to caller

