########## DRAW SCORES ##########

ClearScore:                     # Clear the score
        li $t1, 0                       # Set iterator
        li $t2, 32                      # Set column count
        li $t3, 0x000000                # Set colour

ClearScoreLoop:                 # Clear each pixel
        sw $t3, 0($t0)
        sw $t3, 512($t0)
        sw $t3, 1024($t0)
        sw $t3, 1536($t0)
        sw $t3, 2048($t0)

        addi $t1, $t1, 4                # Next pixel
        blt $t1, $t2, ClearScoreLoop    # If within frame
        jr $ra                          # Return to caller

DrawScore:                      # Draw the score (given $t0)
        lw $t1, Score                   # Get score
        li $t2, 10                      # Set base 10
        div $t1, $t2                    # Get both digits
        mflo $a0                        # Get the 10s
        mfhi $a1                        # Get the 1s

        move $s0, $ra                   # Save original caller
        jal Draw10s                     # Draw 10s
        addi $t0, $t0, 16               # Move over 4 pixels
        jal Draw1s                      # Draw 1s
        move $ra, $s0                   # Load original caller
        jr $ra                          # Return to caller

Draw10s:                        # Draw the 10s digit
        beqz $a0, Draw0                 # If 0
        li $t1, 1                       # Set 1
        beq $a0, $t1, Draw1             # If 1
        li $t1, 2                       # Set 2
        beq $a0, $t1, Draw2             # If 2
        li $t1, 3                       # Set 3
        beq $a0, $t1, Draw3             # If 3
        li $t1, 4                       # Set 4
        beq $a0, $t1, Draw4             # If 4
        li $t1, 5                       # Set 5
        beq $a0, $t1, Draw5             # If 5
        li $t1, 6                       # Set 6
        beq $a0, $t1, Draw6             # If 6
        li $t1, 7                       # Set 7
        beq $a0, $t1, Draw7             # If 7
        li $t1, 8                       # Set 8
        beq $a0, $t1, Draw8             # If 8
        j Draw9                        # If 9

Draw1s:                         # Draw the 1s digit
        beqz $a1, Draw0                 # If 0
        li $t1, 1                       # Set 1
        beq $a1, $t1, Draw1             # If 1
        li $t1, 2                       # Set 2
        beq $a1, $t1, Draw2             # If 2
        li $t1, 3                       # Set 3
        beq $a1, $t1, Draw3             # If 3
        li $t1, 4                       # Set 4
        beq $a1, $t1, Draw4             # If 4
        li $t1, 5                       # Set 5
        beq $a1, $t1, Draw5             # If 5
        li $t1, 6                       # Set 6
        beq $a1, $t1, Draw6             # If 6
        li $t1, 7                       # Set 7
        beq $a1, $t1, Draw7             # If 7
        li $t1, 8                       # Set 8
        beq $a1, $t1, Draw8             # If 8
        j Draw9                        # If 9


