ClearScreen:                    # Makes the whole screen black
        li $t0, 0                       # Get iterator
        li $a0, AREA                    # Get max condition
        la $t1, FRAME_ADR               # Get frame
        li $t2, 0x000000                # Get color

ClearScreenLoop:                # Clear next pixel
        sw $t2, 0($t1)                  # Clear pixel
        addi $t0, $t0, 1                # Get next iteration
        addi $t1, $t1, 4                # Get next pixel
        blt $t0, $a0, ClearScreenLoop   # If within frame
        jr $ra                          # Return to caller


########## DRAW MENUS ##########

DrawMenuButtons:                # Draws the correct menu button
        lw $t1, MenuSelect              # Get selected menu
        li $t2, 0                       # Get menu option play
        beq $t1, $t2, DrawMenuPlay      # Draw play
        li $t2, 1                       # Get menu option how-to
        beq $t1, $t2, DrawMenuHowTo     # Draw how-to
        j DrawMenuQuit                  # Draw quit

