DrawMenu:                       # Draws the menu
        la $t1, FRAME_ADR               # Gets the frame address
        la $t2, Menu                    # Gets the background

DrawMenuLoop:                   # Draw the pixel
        lw $t0, 0($t2)                  # Get the colour
        sw $t0, 0($t1)                  # Draw tile
        addi $t1, $t1, 4                # Next tile
        addi $t2, $t2, 4                # Next background tile
        sub $t3, $t1, FRAME_ADR         # Get counter
        li $t4, AREA_BF			# Load the screen size
        blt $t3, $t4, DrawMenuLoop      # If pixel within range
        jr $ra                          # Return to caller

DrawHowto:                      # Draws the map
        la $t1, FRAME_ADR               # Gets the frame address
        la $t2, HowTo                   # Gets the background

DrawHowtoLoop:                  # Draw the pixel
        lw $t0, 0($t2)                  # Get the colour
        sw $t0, 0($t1)                  # Draw tile
        addi $t1, $t1, 4                # Next tile
        addi $t2, $t2, 4                # Next background tile
        sub $t3, $t1, FRAME_ADR         # Get counter
        li $t4, AREA_BF			# Load the screen size
        blt $t3, $t4, DrawHowtoLoop     # If pixel within range
        jr $ra                          # Return to caller

