########## DRAW MAP ##########

DrawMap:                        # Draws the map
        la $t1, FRAME_ADR               # Gets the frame address
        la $t2, Background              # Gets the background

DrawMapLoop:                    # Draw the pixel
        lw $t0, 0($t2)                  # Get the colour
        sw $t0, 0($t1)                  # Draw tile
        addi $t1, $t1, 4                # Next tile
        addi $t2, $t2, 4                # Next background tile
        sub $t3, $t1, FRAME_ADR         # Get counter
        li $t4, AREA_BF			# Load the screen size
        blt $t3, $t4, DrawMapLoop       # If pixel within range
        jr $ra                          # Return to caller

DrawLevel1:                     # Lights level 1
        la $t0, FRAME_ADR

        li $t1, 0xffd800
        sw $t1, 19488($t0)
        sw $t1, 19996($t0)
        sw $t1, 20000($t0)
        sw $t1, 20512($t0)
        sw $t1, 21024($t0)
        sw $t1, 21532($t0)
        sw $t1, 21536($t0)
        sw $t1, 21540($t0)

        jr $ra

ClearLevel1:                    # Unlights level 1
        la $t0, FRAME_ADR

        li $t1, 0x000000
        sw $t1, 19488($t0)
        sw $t1, 19996($t0)
        sw $t1, 20000($t0)
        sw $t1, 20512($t0)
        sw $t1, 21024($t0)
        sw $t1, 21532($t0)
        sw $t1, 21536($t0)
        sw $t1, 21540($t0)

        jr $ra

