DrawHealth:                     # Draws the healthbar
        lw $a0, Health                  # Gets health
        beqz $a0, DrawHealthEnd         # If no health
        li $a1, 0                       # Sets initial index
        li $t0, FRAME_ADR               # Get frame address
        li $t1, 2                       # Get critical health boundary
        ble $a0, $t1, CritHP            # If critical health
        li $t1, 4                       # Get low health boundary
        ble $a0, $t1, LowHP             # If low health
        li $t1, 6                       # Get med health boundary
        ble $a0, $t1, MedHP             # If med health
        li $t1, 8                       # Get high health boundary
        ble $a0, $t1, HighHP            # If high health
        li $t1, 0x3ac937                # Get max health colour
        j DrawHealthLoop                # Draw bar

CritHP:                         # Critical health
        li $t1, 0xc61f05                # Get max health colour
        j DrawHealthLoop                # Draw bar

LowHP:                          # Low health
        li $t1, 0xc6801d                # Get max health colour
        j DrawHealthLoop                # Draw bar

MedHP:                          # Medium health
        li $t1, 0xc6b425                # Get max health colour
        j DrawHealthLoop                # Draw bar

HighHP:                         # High health
        li $t1, 0x96c62d                # Get max health colour    

DrawHealthLoop:                 # Draws health bar
        sw $t1, 6680($t0)
        sw $t1, 6684($t0)
        sw $t1, 7192($t0)
        sw $t1, 7196($t0)
        sw $t1, 7704($t0)
        sw $t1, 7708($t0)
        addi $t0, $t0, 8                # Get next pixel

DrawHealthNext:                 # Gets next health point
        addi $a1, $a1, 1                # Get next point
        blt $a1, $a0, DrawHealthLoop    # If player still has health points

DrawHealthEnd:                  # Ends draw health
        jr $ra                          # Return to caller

ClearHealth:                    # Removes the health bar
        li $t0, FRAME_ADR               # Get frame address
        li $t1, 10                      # Get the iterator

ClearHealthLoop:                # Removes each health point
        li $t2, 0x000000
        sw $t2, 6680($t0)
        sw $t2, 6684($t0)
        sw $t2, 7192($t0)
        sw $t2, 7196($t0)
        sw $t2, 7704($t0)
        sw $t2, 7708($t0)

ClearHealthUpdate:              # Updates next health bar
        addi $t1, $t1, -1               # Get next health
        addi $t0, $t0, 8                # Get next pixel
        bgtz $t1, ClearHealthLoop       # Next health point

ClearHealthEnd:                 # Exits clear health
        jr $ra                          # Return to caller

DrawJump:                       # Draw the jump bar
        lw $t2, InDoubleJump            # Get double jump state
        bgtz $t2, DrawJumpEnd           # If no more jumps
        li $t0, FRAME_ADR
        li $t1, 0xff6a00
        sw $t1, 13848($t0)
        sw $t1, 13852($t0)
        sw $t1, 13856($t0)
        sw $t1, 13860($t0)
        sw $t1, 13864($t0)
        sw $t1, 13868($t0)
        sw $t1, 13872($t0)
        sw $t1, 13876($t0)
        sw $t1, 13880($t0)
        sw $t1, 13884($t0)

        lw $t2, InJump                  # Get jump state
        bgtz $t2, DrawJumpEnd           # If no more jumps
        sw $t1, 13888($t0)
        sw $t1, 13892($t0)
        sw $t1, 13896($t0)
        sw $t1, 13900($t0)
        sw $t1, 13904($t0)
        sw $t1, 13908($t0)
        sw $t1, 13912($t0)
        sw $t1, 13916($t0)
        sw $t1, 13920($t0)
        sw $t1, 13924($t0)

DrawJumpEnd:                    # Exits draw jump
        jr $ra                          # Return to caller

ClearJump:                      # Clear the jump bar
        li $t0, FRAME_ADR               # Set offset start
        li $t1, 0x000000                # Set clear colour
        li $t2, 20                      # Set counter

ClearJumpLoop:                  # Clear each jump bar pixel
        sw $t1, 13848($t0)
        addi $t0, $t0, 4                # Next pixel
        addi $t2, $t2, -1               # Increment counter
        bgtz $t2, ClearJumpLoop         # Go to next pixel
        jr $ra                          # Return to caller

CreateMap:                      # Saves the map
        la $t0, Background

        move $s0, $ra                   # Save original caller
        jal CreateSideBar               # Create sidebar
        jal CreateField                 # Create field
        move $ra, $s0                   # Load original caller
        jr $ra                          # Return to caller
        
